ми и получить необходимую информацию<br>','contacts','','',NULL),(13,NULL,'2022-02-01 15:32:25.124225','2022-02-01 15:32:25.130768',13,1,3,'','Консультация','Вы можете связаться с нашими специалистами и получить необходимую информацию<br>','contacts','','',NULL),(14,NULL,'2022-02-03 15:54:39.211997','2022-02-03 15:54:39.212020',14,1,4,NULL,'Сео-тексты для товаров/услуг',NULL,'seo_for_products',NULL,NULL,NULL),(15,NULL,'2022-02-03 16:09:40.138810','2022-02-03 16:14:22.409604',15,1,3,'','Виды страховых полисов','Наши лицензии и сертификаты качества<br>','faq','','',NULL),(16,NULL,'2022-02-04 10:51:42.567316','2022-02-04 10:59:18.040677',16,1,99,'','Форма страхования \"Хоккей\"','','form_hockey','','',NULL),(17,NULL,'2022-02-04 10:59:47.680657','2022-02-15 11:02:55.126168',17,1,3,'','Форма страхования \"Хоккей\"','','form_cruises','','',NULL),(18,NULL,'2022-02-06 18:51:50.325949','2022-02-06 18:51:50.339135',18,1,3,'','Контакты','Вы можете связаться с нашими специалистами и получить необходимую информацию<br>','contacts','','',NULL),(19,NULL,'2022-02-07 09:26:02.479607','2022-02-07 09:33:56.298520',19,1,3,'','О нас','<div>\r\n			<div>\r\n				<div>\r\n					<p>Таблица страховых выплат «Детская»\r\n</p>\r\n					<p>в случае телесного повреждения (травмы) в результате несчастного случая\r\n/в процентах от страховой суммы/\r\n</p>\r\n					<p>Выплата может производиться по нескольким статьям одновременно. Если\r\nимеются основания для выплаты по нескольким пунктам внутри одной статьи, то\r\nвыплата начисляется по пункту, предусматривающему более высокий размер\r\nвыплаты. Если была произведена выплата по одному из пунктов статьи, а позднее\r\nпризнается основание для более высокой выплаты по этой же статье, то\r\nначисляется выплата по пункту, предусматривающему более высокий размер\r\nвыплаты, причем размер выплаты уменьшается на выплаченную ранее сумму. В\r\nлюбом случае сумма выплат не может превышать 100% страховой суммы по\r\nданному риску.\r\n</p>\r\n					<p>ЦЕНТРАЛЬНАЯ И ПЕРИФЕРИЧЕСКАЯ НЕРВНАЯ СИСТЕМА<span>1 \r\n						\r\n						Перелом костей черепа:<br>\r\nа) \r\n						\r\n						перелом наружной пластинки костей свода, расхождение 5\r\n</span></p>\r\n					<p>шва<span>б) \r\n						\r\n						перелом свода 15\r\nв) \r\n						\r\n						перелом основания 25\r\nг) \r\n						\r\n						перелом свода и основания 30\r\n</span></p>\r\n					<p>3 Внутричерепное травматическое кровоизлияние:<br>\r\nа) \r\n						\r\n						субарахноидальное 5\r\nб) \r\n						\r\n						эпидуральная гематома 10\r\nв) \r\n						\r\n						субдуральная (внутримозговая, внутрижелудочковая) 15\r\n</p>\r\n					<p>гематома\r\n</p>\r\n					<p>5 Ушиб головного мозга 10\r\n6 \r\n						\r\n						Неудаленные инородные тела полости черепа (за\r\n</p>\r\n					<p>исключением шовного и пластического материала) 15\r\n7 \r\n						\r\n						Повреждение спинного мозга на любом уровне, а\r\n</p>\r\n					<p>также «конского хвоста»:<br>\r\nа) \r\n						\r\n						ушиб 10\r\nб) \r\n						\r\n						сдавление, гематомиелия, частичный или полный разрыв 60\r\n</p>\r\n					<p>спинного мозга, хирургические операции на спинном мозге\r\n</p>\r\n				</div>\r\n			</div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Статья\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>ХАРАКТЕР ПОВРЕЖДЕНИЯ\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Размер\r\nстраховой\r\nвыплаты\r\n(в % от\r\nстраховой\r\nсуммы)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>2\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Открытый перелом костей черепа или оперативные\r\nвмешательства на головном мозге и его оболочках в\r\nсвязи с черепно-мозговой травмой, независимо от\r\nколичества оперативных вмешательств\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>+5\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>4\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Сотрясение головного мозга, подтвержденное\r\nневрологическим статусом, при сроках\r\nамбулаторного или стационарного лечения не менее\r\n10 дней\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>2\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<ol>\r\n						<li>\r\n							<p>8 &nbsp;Периферическое повреждение (разрыв) черепно- 10\r\nмозговых нервов\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>9 &nbsp;Повреждение (разрыв) шейного, плечевого,\r\nпоясничного, крестцового сплетений и их нервов:\r\nПовреждение сплетений:\r\n</p>\r\n						</li>\r\n					</ol>\r\n					<p>а) частичный разрыв сплетения 40\r\nб) разрыв сплетения 70\r\n</p>\r\n					<p>в) на уровне лучезапястного, голеностопного сустава 10\r\nг) на уровне предплечья, голени 20\r\nд) на уровне плеча, локтевого сустава, бедра, коленного 40\r\n</p>\r\n					<p>сустава<span>е) разрыв ветвей лучевого, локтевого, пальцевого, срединного 1\r\n</span></p>\r\n					<p>(пальцевых нервов)\r\n</p>\r\n					<p>ОРГАНЫ ЗРЕНИЯ\r\n</p>\r\n					<ol>\r\n						<li>\r\n							<p>10 &nbsp;Паралич аккомодации одного глаза 15\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>11 &nbsp;Гемианопсия одного глаза 15\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>12 &nbsp;Сужение поля зрения одного глаза:\r\n</p>\r\n						</li>\r\n					</ol>\r\n					<p>а) неконцентрическое 3\r\nб) концентрическое 10\r\n</p>\r\n					<ol>\r\n						<li>\r\n							<p>13 &nbsp;Пульсирующий экзофтальм одного глаза 10\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>14 &nbsp;Проникающее ранение глазного яблока, рубцовый 10\r\n</p>\r\n							<p>трихиаз\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>15 &nbsp;Необратимое нарушение функции слезопроводящих 3\r\n</p>\r\n							<p>путей одного глаза\r\n</p>\r\n						</li>\r\n					</ol>\r\n					<ol>\r\n						<li>\r\n							<p>17 &nbsp;Повреждение одного глаза, повлекшее за собой 50\r\nполную потерю зрения одного глаза\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>18 &nbsp;Удаление в результате травмы глазного яблока, не 10\r\nобладавшего зрением\r\n</p>\r\n						</li>\r\n						<li>\r\n							<p>19 &nbsp;Перелом орбиты 10\r\n</p>\r\n						</li>\r\n					</ol>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Разрыв нервов шейного, плечевого, поясничного,\r\nкрестцового сплетений (подмышечного, лучевого,\r\nлоктевого, срединного, бедренного, седалищного,\r\nмалоберцового, большеберцового нервов):\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>16\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Ожоги II-III степени, непроникающие ранения\r\nглазного яблока, гемофтальм, смещение хрусталика\r\n(за исключением протезированного), не удаленные\r\nинородные тела глазного яблока и тканях глазницы,\r\nрубцы оболочек глазного яблока, не вызвавшие\r\nснижение зрения, эрозия роговицы<span>Поверхностные инородные тела на оболочках глаза не\r\nдают оснований для выплаты\r\n</span></p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>3\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: 1. Ожоги глаза без указания степени, а также ожоги глаза I степени,\r\nне повлекшие за собой патологических изменений, не дают оснований для\r\nстраховой выплаты.\r\n</p>\r\n						<p>2. Решение о страховой выплате по ст. 9 – 19 в общем случае принимается по\r\nитогам освидетельствования, проведенного после окончания лечения, но не ранее\r\n3-х месяцев со дня травмы (при условии сохранения диагноза на этот момент). По\r\nотдельным диагнозам возможна немедленная выплата.<br>\r\n3. Сумма выплат по ст.9 -19 не должна превышать 50% на один глаз.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div>\r\n		<div>\r\n			\r\n			<div>\r\n				<div>\r\n					<p>ОРГАНЫ СЛУХА<span>20 Повреждение ушной раковины, повлекшее за собой:<br>\r\nа) рубцовую деформацию или отсутствие 1/3 ушной раковины 3\r\nб) отсутствие половины ушной раковины 5\r\nв) полное отсутствие ушной раковины 10\r\n21 Травматическое снижение слуха, подтвержденное\r\n</span></p>\r\n					<p>аудиометрией:<br>\r\nа) на одно ухо 5\r\nб) полную глухоту (анакузия) (разговорная речь 0) 30\r\n22 Разрыв барабанной перепонки, наступивший в\r\n</p>\r\n					<p>результате травмы, без снижения слуха 5\r\n</p>\r\n					<p>ДЫХАТЕЛЬНАЯ СИСТЕМА<span>23 \r\n						\r\n						Перелом костей носа, передней стенки лобной, 1\r\n</span></p>\r\n					<p>гайморовой пазух, решетчатой кости\r\n</p>\r\n					<p>а) с одной стороны 10\r\nб) \r\n						\r\n						с двух сторон 20\r\n25 \r\n						\r\n						Повреждение легкого, повлекшее за собой:<br>\r\nа) \r\n						\r\n						удаление сегмента или нескольких сегментов легкого 15\r\nб) \r\n						\r\n						удаление доли легкого 30\r\nв) \r\n						\r\n						удаление одного легкого 50\r\n26 \r\n						\r\n						Перелом грудины 5\r\n27 \r\n						\r\n						Переломы двух или более ребер:\r\n</p>\r\n					<p>а) \r\n						\r\n						двух ребер 1\r\nб) \r\n						\r\n						трех и более 3\r\n28 \r\n						\r\n						Проникающее ранение грудной клетки, торакотомия\r\n</p>\r\n					<p>(независимо от количества) по поводу травмы:<br>\r\nа) \r\n						\r\n						при отсутствии травматического повреждения органов 3\r\n</p>\r\n					<p>грудной клетки<span>б) \r\n						\r\n						при травматическом повреждении органов грудной клетки 10\r\n*Примечание: Если легкое или его часть были удалены по причине ранения\r\nгрудной клетки, ст. 28 не применяется.<span>29 \r\n						\r\n						Повреждение гортани, трахеи, перелом 10\r\n</span></span></p>\r\n					<p>подъязычной кости\r\n</p>\r\n					<p>*Примечание: Если предусмотрены выплаты по ст. 30, ст.29 не применяется.\r\n</p>\r\n					<p>СЕРДЕЧНО-СОСУДИСТАЯ СИСТЕМА\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: Разрыв барабанной перепонки при переломах основания черепа не\r\nдаёт основания для выплаты по этой статье. Решение о выплате по ст. 20-22 в\r\nобщем случае принимается после окончания лечения, но не ранее 6 месяцев со дня\r\nтравмы, при условии сохранения диагноза на момент выплаты. Если выплата\r\nпроизводится по ст. 1 п. (в, г) ст. 21 не применяется.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>24\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение легкого, вызвавшее подкожную\r\nэмфизему, гемоторакс, пневмонию, экссудативный\r\nплеврит; инородное тело (тела) грудной полости:\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>30\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение гортани, трахеи, подъязычной кости,\r\nщитовидного хряща, ожог верхних дыхательных\r\nпутей повлекшие за собой ношение\r\nтрахеостомической трубки\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>31\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение сердца, эндо-, мио- и эпикарда и\r\nкрупных магистральных сосудов, повлекшее за\r\nсобой сердечно-сосудистую недостаточность\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>35\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>32\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение сердца, эндо-, мио- и эпикарда,\r\nкрупных магистральных или периферических\r\nсосудов, не повлекшее за собой сердечно-\r\nсосудистую недостаточность\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>5\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>33\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение крупных периферических сосудов,\r\nповлекшее за собой сердечно-сосудистую\r\nнедостаточность\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>25\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>*Примечания:<br>\r\n1. К крупным магистральным сосудам следует относить: аорту, легочную,\r\nбезымянную, сонные артерии, внутренние яремные вены, верхнюю и нижнюю\r\nполые вены, воротную вену, а также магистральные сосуды, обеспечивающие\r\nкровообращение внутренних органов.<br>\r\n2. К крупным периферическим сосудам следует относить: подключичные,\r\nподмышечные (подкрыльцовые), плечевые локтевые и лучевые артерии,\r\nподвздошные, бедренные, подколенные, передние и задние большеберцовые\r\nартерии; плечеголовные, подключичные, подмышечные, бедренные и подколенные\r\nвены.<br>\r\n3. Выплата по ст.31 или ст.33 производится, если указанные осложнения будут\r\nустановлены по истечении 6 месяцев после травмы. При выплате по ст.31 или ст.33\r\nвыплата, сделанная ранее по ст.32, удерживается.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<p>ОРГАНЫ ПИЩЕВАРЕНИЯ<span>34 Переломы челюсти:<br>\r\nа) верхней челюсти, скуловых костей 5\r\nб) нижней челюсти 5\r\n35 Повреждение челюсти, повлекшее за собой:<br>\r\nа) отсутствие части челюсти (за исключением альвеолярного 40\r\n</span></p>\r\n					<p>отростка)<span>б) отсутствие челюсти 60\r\n*Примечание: При выплате по ст.35 учтена и потеря зубов (независимо от их\r\nколичества). Если предусмотрены выплаты по ст. 35, то ст. 34 не применяется.\r\n36 \r\n						\r\n						Повреждение языка, повлекшее за собой:<br>\r\nа) \r\n						\r\n						отсутствие языка на уровне дистальной трети 10<span>б) \r\n						\r\n						на уровне средней трети 30<span>в) \r\n						\r\n						на уровне корня, полное отсутствие 50\r\n</span></span></span></p>\r\n					<p>38 Повреждение пищевода, вызвавшее его сужение 30\r\n39 \r\n						\r\n						Повреждение органов пищеварения, повлекшее за\r\n</p>\r\n					<p>собой:<br>\r\nа) \r\n						\r\n						рубцовое сужение желудка, кишечника, заднепроходного 15\r\n</p>\r\n					<p>отверстия<span>б) \r\n						\r\n						спаечную болезнь, состояние после операции по поводу 25\r\n</span></p>\r\n					<p>спаечной непроходимости<span>в) \r\n						\r\n						кишечный свищ, кишечно-влагалищный свищ, свищ 40\r\n</span></p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>37\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение желчного пузыря в результате\r\nтравмы, повлекшее за собой удаление желчного\r\nпузыря\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>10\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<p>поджелудочной железы\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			<div>\r\n				<div>\r\n					<p>г) \r\n						\r\n						наложение колостомы, при условии сохранения колостомы 50\r\nпо истечению 6 мес. после травмы\r\n</p>\r\n					<p>40 \r\n						\r\n						Повреждение печени в результате травмы,\r\nповлекшее за собой:\r\n</p>\r\n					<p>а) \r\n						\r\n						подкапсульный разрыв печени, потребовавший 20\r\nоперативного вмешательства\r\n</p>\r\n					<p>б) \r\n						\r\n						подкапсульный разрыв печени, не потребовавший 5\r\nоперативного вмешательства\r\n</p>\r\n					<p>в) \r\n						\r\n						удаление более половины печени в результате травмы 30\r\n</p>\r\n					<p>41 Повреждение селезенки, повлекшее за собой:<br>\r\nа) \r\n						\r\n						подкапсульный разрыв селезенки, не потребовавший 10\r\n</p>\r\n					<p>оперативного вмешательства<span>б) \r\n						\r\n						удаление селезенки 20\r\n42 \r\n						\r\n						Повреждения желудка, поджелудочной железы,\r\n</span></p>\r\n					<p>кишечника, брыжейки, повлекшие за собой:<br>\r\nа) \r\n						\r\n						удаление части до 1/3 желудка, 1/3 кишечника 15\r\nб) \r\n						\r\n						удаление части 1/2 желудка, 1/3 хвоста поджелудочной 25\r\n</p>\r\n					<p>железы, 1/2 кишечника<span>в) \r\n						\r\n						удаление части 2/3 желудка, 2/3 кишечника, 2/3 тела 40\r\n</span></p>\r\n					<p>поджелудочной железы<span>г) \r\n						\r\n						удаление желудка, 2/3 поджелудочной железы, кишечника 50\r\nМОЧЕПОЛОВАЯ СИСТЕМА<span>43 \r\n						\r\n						Повреждение почки, повлекшее за собой:\r\n</span></span></p>\r\n					<p>б) удаление почки 50\r\n44 \r\n						\r\n						Повреждение органов мочевыделительной системы,\r\n</p>\r\n					<p>повлекшее за собой:\r\n</p>\r\n					<p>б) непроходимость мочеточника, мочеиспускательного канала, 40\r\nмочеполовые свищи\r\n</p>\r\n					<p>*Примечание: Если производится выплата по ст. 43, ст. 45 не применяется\r\n</p>\r\n					<p>46 \r\n						\r\n						Повреждение половой системы, повлекшее за собой:\r\nУ женщин:\r\n</p>\r\n					<p>а) \r\n						\r\n						потерю одного яичника, яичника и одной маточной трубы, 15\r\nяичника и двух маточных труб\r\n</p>\r\n					<p>б) \r\n						\r\n						потерю двух яичников (единственного яичника) 25\r\nв) \r\n						\r\n						потерю матки с трубами 50\r\nг) \r\n						\r\n						потерю одной молочной железы 15\r\nд) \r\n						\r\n						потерю двух молочных желез 30\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечание: При наличии вирусного или токсического поражения печени до\r\nнаступления несчастного случая, размер выплаты по травме печени составит 50%\r\nот размера, указанного в ст.40.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>удаление части почки, хроническую почечную\r\nнедостаточность (если это осложнение имеется по\r\nистечении 6 месяцев после травмы)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>терминальную стадию острой почечной недостаточности в\r\nрезультате травмы органов мочевыделительной системы\r\nили травматического токсикоза\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>50\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>45\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение органов мочевыделительной системы,\r\nв связи с которым произведено одно или несколько\r\nоперативных вмешательств\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>10\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<p>У мужчин:<br>\r\nе) \r\n						\r\n						потерю двух яичек, части полового члена 30\r\nж) \r\n						\r\n						потерю полового члена 40\r\nз) \r\n						\r\n						потерю полового члена и одного или двух яичек 50\r\nМЯГКИЕ ТКАНИ\r\n</p>\r\n					<p>а) 1% - 2% поверхности тела 1\r\nб) \r\n						\r\n						3% - 5% поверхности тела 3\r\nв) \r\n						\r\n						6% - 9% поверхности тела 10\r\nг) \r\n						\r\n						10% -20% поверхности тела 20\r\nд) \r\n						\r\n						21%-30% поверхности тела 30\r\nе) \r\n						\r\n						31% и более 60\r\n</p>\r\n					<p>а) образование рубцов площадью от 5 см2 и более или общей 10\r\nдлиной 5 см и более\r\n</p>\r\n					<p>б) \r\n						\r\n						образование рубцов площадью от 10 см2 и более или общей 20\r\nдлиной 15 см и более\r\n</p>\r\n					<p>50 Ожоговая болезнь, ожоговый шок 10\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>47\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Размеры страховой выплаты при ожогах II - IV\r\nстепени, за исключением ожогов, возникших в\r\nрезультате воздействия<br>\r\nультрафиолетового (солнечного) излучения,\r\nприведены в последнем разделе настоящей Таблицы\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>-\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>48\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждения (кроме ожогов) мягких тканей\r\nволосистой части головы, туловища, конечностей,\r\nприведших к образованию рубцового повреждения:\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>49\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждения мягких тканей лица, передне-боковой\r\nповерхности шеи, подчелюстной области, ушных\r\nраковин, повлекшие за собой:\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: Если была произведена выплата по ст.47, выплата по ст.49\r\nосуществляется за вычетом ранее произведенной по ст.47 выплаты. При открытых\r\nпереломах костей и операциях выплата за рубцы не производится.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания:<br>\r\n1. К косметически заметным, подлежащим оценке по ст.48 и ст.49, относятся рубцы,\r\nотличающиеся по окраске от окружающей кожи, втянутые или выступающие над ее\r\nповерхностью, стягивающие ткани.<br>\r\n2. Площадь рубцов определяется после проведения лечения, на момент истечения\r\n3 месяцев после травмы. Площадь ожогов определяется по состоянию на момент\r\nистечения 10 дней после травмы.<br>\r\n3. Если косметическое нарушение наступило в результате переломов костей\r\nлицевого черепа или оперативных вмешательствах на костях лицевого черепа,\r\nвызванных травмой, то выплата производится с учетом и перелома, и\r\nпослеоперационного рубца путем суммирования. В остальных случаях выплата за\r\nпослеоперационный рубец или рубец, образовавшийся в результате открытого\r\nперелома, не производится. При определении площади рубцов следует учитывать и\r\nрубцы, образовавшиеся на месте взятия для замещения пораженного участка кожи\r\nкожного трансплантата.<br>\r\n4. 1% поверхности тела исследуемого равен площади ладонной поверхности его\r\nкисти и пальцев. Эта площадь определяется в квадратных сантиметрах путем\r\nумножения длины кисти, измеряемой от лучезапястного сустава до верхушки\r\nногтевой фаланги III пальца на ее ширину, измеряемую на уровне головок II - V\r\nпястных костей (без учета I пальца).\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<p>ПОЗВОНОЧНИК<span>51 \r\n						\r\n						Перелом тела, дуги, суставных отростков позвонков\r\n</span></p>\r\n					<p>(за исключением крестца и копчика):<br>\r\nа) \r\n						\r\n						одного-двух позвонков, если хирургические операции на 15\r\n</p>\r\n					<p>позвонках не производились\r\n</p>\r\n					<p>*Примечание: При рецидивах вывиха/подвывиха позвонка страховая выплата не\r\nпроизводится.<span>53 \r\n						\r\n						Перелом поперечных или остистых отростков:<br>\r\nа) \r\n						\r\n						одного-двух 5\r\n</span></p>\r\n					<p>б) \r\n						\r\n						трех и более 10\r\n*Примечание: Если предусмотрены выплаты по ст.51, ст.53 не применяется\r\n54 \r\n						\r\n						Перелом крестца 10\r\n55 \r\n						\r\n						Повреждение копчика:\r\n</p>\r\n					<p>а) \r\n						\r\n						перелом копчиковых позвонков 10\r\nб) \r\n						\r\n						удаление копчиковых позвонков в связи с травмой 15\r\nВЕРХНЯЯ КОНЕЧНОСТЬ (ЗА КАЖДУЮ РУКУ)<br>\r\nЛОПАТКА, КЛЮЧИЦА\r\n</p>\r\n					<p>а) перелом одной кости, отрыв клювовидного отростка 5\r\nлопатки, разрыв связок одного сочленения\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>б)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>трех- и более позвонков, хирургические операции на\r\nпозвонках или остистых отростках (кроме копчика), в том\r\nчисле замена или удаление позвонков (кроме копчика)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>52\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Полный разрыв межпозвоночных связок (при\r\nгоспитализации не менее 14 дней), вывих\r\nпозвонков (за исключением копчика)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>10\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>56\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Перелом лопатки (кроме суставной впадины),\r\nключицы, полный или частичный разрыв связок\r\nакромиально-ключичного, грудино-ключичного\r\nсочленений:\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			<div>\r\n				<div>\r\n					<p>б) \r\n						\r\n						перелом двух костей, двойной перелом одной кости, разрыв 10\r\nсвязок двух сочленений, перелом-вывих ключицы\r\n</p>\r\n					<p>ПЛЕЧЕВОЙ СУСТАВ\r\n</p>\r\n					<p>б) перелом двух костей, перелом-вывих 10\r\n</p>\r\n					<p>58 Повреждение плечевого сустава, повлекшее за\r\nсобой:\r\n</p>\r\n					<p>б) \"болтающийся\" плечевой сустав в результате резекции\r\nсуставных поверхностей составляющих его костей 40\r\n</p>\r\n				</div>\r\n			</div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>в)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>несросшийся перелом (ложный сустав), перелом двух\r\nкостей и разрыв одного сочленения. Выплата по ст.56,\r\nпункт в) по диагнозу «несросшийся перелом (ложный\r\nсустав)» производится не ранее, чем через 9 месяцев со\r\nдня травмы при условии сохранения диагноза на момент\r\nвыплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>15\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>57\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение плечевого сустава (перелом суставной\r\nвпадины лопатки, головки плечевой кости,\r\nанатомической шейки плечевой кости или лопатки,\r\nотрывы бугорков плечевой кости, разрыв связок или\r\nсуставной капсулы):\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>разрыв связок или суставной капсулы, перелом одной\r\nкости, отрывы бугорков плечевой кости, вывих плеча\r\n(кроме привычного вывиха плеча)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>5\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>в)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>несросшийся перелом. Выплата по ст.57, пункт в)\r\nпроизводится не ранее, чем через 9 месяцев со дня травмы\r\nпри условии сохранения диагноза на момент выплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>отсутствие движений в суставе (анкилоз). Выплата по ст.58,\r\nпункт а) производится не ранее, чем через 9 месяцев со\r\nдня травмы при условии сохранения диагноза на момент\r\nвыплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>30\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: Если по причине повреждений, перечисленных в ст.56, 57 и 58,\r\nпроводились хирургические вмешательства, дополнительной выплате подлежит\r\n10% страховой суммы. При этом дополнительная выплата за взятие трансплантата\r\nне производится.\r\n</p>\r\n						<p>Если в связи с травмой плечевого сустава производилась выплата по ст.57, а затем\r\nвозникли осложнения, перечисленные в ст.58, выплаты производятся в\r\nсоответствии с одним из подпунктов ст.58, за вычетом ранее произведенной\r\nвыплаты.\r\n</p>\r\n						<p>Примечание к ст. 57: При рецидивах вывиха/подвывиха плеча страховая выплата\r\nне производится\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<p>ПЛЕЧО<span>59 Перелом плечевой кости на любом уровне* (за\r\n</span></p>\r\n					<p>исключением суставов):<br>\r\nа) без смещения 10\r\nб) со смещением, двойной перелом 15\r\n</p>\r\n					<p>*Примечание: рефрактуры (фокальные и парафокальные)\r\n</p>\r\n					<p>не являются основанием для страховой выплаты<span>60 Перелом плечевой кости, осложнённый 35\r\n</span></p>\r\n					<p>образованием ложного сустава\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечание: Выплата по ст.60 производится не ранее, чем через 9 месяцев со дня\r\nтравмы при условии сохранения диагноза на момент выплаты.<br>\r\nЕсли в связи с травмой плечевого сустава производилась выплата по ст.59, а затем\r\nвозникли осложнения, указанные в ст.60, выплаты производятся в соответствии со\r\nст.60, за вычетом ранее произведенной выплаты.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<p>ЛОКТЕВОЙ СУСТАВ\r\n</p>\r\n					<p>б) перелом двух или трех костей, перелом одной-двух костей 10\r\nи разрыв связок / капсулы\r\n</p>\r\n					<p>в) \r\n						\r\n						перелом костей со смещением отломков 15\r\n62 \r\n						\r\n						Повреждение области локтевого сустава, повлекшее\r\n</p>\r\n					<p>за собой:\r\n</p>\r\n					<p>б) \"болтающийся\" локтевой сустав (в результате резекции\r\nсуставных поверхностей составляющих его костей) 40\r\n</p>\r\n					<p>ПРЕДПЛЕЧЬЕ<span>63 \r\n						\r\n						Перелом костей предплечья (локтевой, лучевой) на\r\n</span></p>\r\n					<p>любом уровне, за исключением области суставов*<br>\r\nа) \r\n						\r\n						перелом одной кости 3\r\nб) \r\n						\r\n						перелом двух костей 10\r\n</p>\r\n					<p>*Примечание: рефрактуры (фокальные и парафокальные)\r\n</p>\r\n					<p>не являются основанием для страховой выплаты\r\n</p>\r\n					<p>ЛУЧЕЗАПЯСТНЫЙ СУСТАВ\r\n</p>\r\n					<p>а) перелом костей 3<span>б) \r\n						\r\n						полный или частичный разрыв связок 1<span>65 \r\n						\r\n						Травматический анкилоз лучезапястного сустава 10\r\n*Примечание: Выплата по ст.65 производится не ранее, чем через 9 месяцев со дня\r\nтравмы при условии сохранения диагноза на момент выплаты.\r\n</span></span></p>\r\n					<p>КОСТИ КИСТИ\r\n</p>\r\n				</div>\r\n			</div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>61\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждения области локтевого сустава (перелом в\r\nобласти суставных поверхностей, анатомической\r\nшейки локтевой, лучевой, плечевой костей, разрыв\r\nсвязок или капсулы сустава):\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>перелом одной кости, отрыв костных\r\nфрагментов/отростков, разрыв связок (полный или\r\nчастичный разрыв) или капсулы сустава\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>5\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>отсутствие движений в суставе. Выплата по ст.61, пункт а)\r\nпроизводится не ранее, чем через 9 месяцев со дня травмы\r\nпри условии сохранения диагноза на момент выплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>30\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: Если по причине повреждений, перечисленных в ст. 61 и 62,\r\nпроводились хирургические вмешательства, дополнительной выплате подлежит\r\n10% страховой суммы. При этом дополнительная выплата за взятие трансплантата\r\nне производится.<br>\r\nЕсли в связи с травмой локтевого сустава производилась выплата по ст.61, а затем\r\nвозникли осложнения, перечисленные в ст.62, выплаты производятся в\r\nсоответствии с одним из подпунктов ст.62, за вычетом ранее произведенной\r\nвыплаты.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>64\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Перелом костей предплечья в области дистального\r\nметафиза, межсуставный перелом костей,\r\nсоставляющих лучезапястный сустав, полный или\r\nчастичный разрыв связок:\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			<div>\r\n				<div>\r\n					<p>66 \r\n						\r\n						Перелом или вывих костей:<br>\r\nа) \r\n						\r\n						одной кости (за исключением ладьевидной) 1\r\nб) \r\n						\r\n						двух и более костей (за исключением ладьевидной), 3\r\n</p>\r\n					<p>ладьевидной кости\r\n</p>\r\n					<p>ПАЛЬЦЫ КИСТИ: ПЕРВЫЙ ПАЛЕЦ (БОЛЬШОЙ ПАЛЕЦ)<span>67 \r\n						\r\n						Перелом, разрыв сухожилий или капсулы суставов\r\n</span></p>\r\n					<p>3\r\n</p>\r\n					<p>68 \r\n						\r\n						Повреждение пальца, повлекшее за собой\r\nотсутствие движений:\r\n</p>\r\n					<p>а) \r\n						\r\n						в одном суставе 1<span>б) \r\n						\r\n						в двух суставах 3\r\n*Примечание: Выплата по ст.68 производится не ранее, чем через 6 месяцев со дня\r\nтравмы при условии сохранения диагноза на момент выплаты.<span>69 \r\n						\r\n						Потеря первого пальца 15\r\nПАЛЬЦЫ КИСТИ: ВТОРОЙ, ТРЕТИЙ, ЧЕТВЕРТЫЙ, ПЯТЫЙ ПАЛЬЦЫ<span>70 \r\n						\r\n						Перелом, разрыв сухожилий или капсулы суставов 1\r\n</span></span></span></p>\r\n					<p>пальца - за каждый палец<span>71 \r\n						\r\n						Потеря второго пальца 5\r\n72 \r\n						\r\n						Потеря третьего, четвёртого, пятого пальца - за 3\r\n</span></p>\r\n					<p>каждый палец\r\n</p>\r\n					<p>НИЖНЯЯ КОНЕЧНОСТЬ (ЗА КАЖДУЮ НОГУ)<br>\r\nТАЗ<span>74 \r\n						\r\n						Перелом костей таза:<br>\r\nа) \r\n						\r\n						перелом крыла подвздошной кости 10\r\nб) \r\n						\r\n						перелом лонной, седалищной кости, тела подвздошной 10\r\n</span></p>\r\n					<p>кости, вертлужной впадины<span>в) \r\n						\r\n						перелом двух и более костей или двойной перелом одной 15\r\n</span></p>\r\n					<p>кости\r\n</p>\r\n					<p>75 \r\n						\r\n						Разрыв лонного, крестцово-подвздошного\r\nсочленения:\r\n</p>\r\n					<p>а) \r\n						\r\n						одного сочленения 10\r\nб) \r\n						\r\n						двух и более сочленений 15\r\n76 \r\n						\r\n						Перелом головки, шейки бедра вывих бедра,\r\n</p>\r\n					<p>полный или частичный разрыв связок:<br>\r\nа) \r\n						\r\n						перелом головки, шейки, вывих бедра 10\r\nб) \r\n						\r\n						полный и частичный разрыв связок 5\r\n77 \r\n						\r\n						Повреждение тазобедренного сустава, повлекшее за\r\n</p>\r\n					<p>собой:\r\n</p>\r\n					<p>б) \"болтающийся\" сустав (в результате резекции головки 40\r\nбедра, вертлужной впадины)\r\n</p>\r\n					<p>*Примечание к ст. 76: При рецидивах вывиха/подвывиха бедра страховая выплата\r\nне производится.<span>БЕДРО\r\n</span></p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>73\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Травматическая ампутация всех пальцев руки или\r\nповреждение, приведшее к ампутации всех пальцев\r\nруки\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>40\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>отсутствие движений (анкилоз). Выплата по ст.77, пункт а)\r\nпроизводится не ранее, чем через 9 месяцев со дня травмы\r\nпри условии сохранения диагноза на момент выплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			\r\n			<div>\r\n				<div>\r\n					<p>78 \r\n						\r\n						Перелом бедра на любом уровне (за исключением\r\nобласти суставов):\r\n</p>\r\n					<p>а) \r\n						\r\n						без смещения отломков 15\r\nб) \r\n						\r\n						со смещением, двойной перелом бедра 20\r\n79 \r\n						\r\n						Перелом бедра, осложнившийся образованием\r\n</p>\r\n					<p>ложного сустава (несросшийся перелом) 50\r\n</p>\r\n					<p>КОЛЕННЫЙ СУСТАВ<span>80 Повреждение области коленного сустава, повлекшее\r\n</span></p>\r\n					<p>за собой:<br>\r\nа) Разрыв мениска (менисков), разрыв связок, отрывы\r\n</p>\r\n					<p>костного фрагмента (фрагментов), гемартроз 3\r\nб) перелом коленной чашечки 10\r\n</p>\r\n					<p>81 Повреждение коленного сустава, повлекшее за\r\nсобой:\r\n</p>\r\n					<p>б) болтающийся\" коленный сустав (в результате резекции 25\r\nсуставных поверхностей составляющих его костей)\r\n</p>\r\n					<p>ГОЛЕНЬ<span>82 Перелом костей голени* (за исключением области\r\n</span></p>\r\n					<p>суставов):<br>\r\nа) малоберцовой кости 5\r\nб) большеберцовой, двойной перелом малоберцовой 10\r\nв) обеих костей, двойной перелом большеберцовой 15\r\n</p>\r\n					<p>*Примечание: рефрактуры (фокальные и парафокальные)\r\n</p>\r\n					<p>не являются основанием для страховой выплаты\r\n</p>\r\n					<p>ГОЛЕНОСТОПНЫЙ СУСТАВ<span>83 \r\n						\r\n						Повреждение области голеностопного сустава:<br>\r\nа) \r\n						\r\n						перелом одной лодыжки или края большеберцовой кости, 5\r\n</span></p>\r\n					<p>разрыв связок или суставной капсулы\r\n</p>\r\n					<p>84 Повреждение голеностопного сустава, повлекшее за\r\nсобой:\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>*Примечания: Выплата по ст.79 производится не ранее, чем через 9 месяцев со дня\r\nтравмы при условии сохранения диагноза на момент выплаты.<br>\r\nЕсли в связи с травмой производилась выплата по ст.78, а затем возникли\r\nосложнения, перечисленные в ст.79, выплаты производятся в соответствии со\r\nст.79, за вычетом ранее произведенной выплаты.\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>в)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>перелом костей, составляющих коленный сустав\r\n(дистальный эпифиз бедра и проксимальный эпифиз\r\nбольшеберцовой кости)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>отсутствие движений в суставе (анкилоз). Выплата по ст.80,\r\nпункт а) производится не ранее, чем через 9 месяцев со\r\nдня травмы при условии сохранения диагноза на момент\r\nвыплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>б)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>перелом обеих лодыжек (костей голени), перелом лодыжки\r\nс краем большеберцовой кости, разрыв дистального\r\nмежберцового синдесмоза\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>10\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>в)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>перелом одной или двух лодыжек с краем большеберцовой\r\nкости и разрыв дистального межберцового синдесмоза в\r\nсочетании с подвывихом (вывихом) стопы\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>а)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>отсутствие движений в суставе (анкилоз). Выплата по ст.83,\r\nпункт а) производится не ранее, чем через 9 месяцев со\r\nдня травмы при условии сохранения диагноза на момент\r\nвыплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>20\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>б)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>\"болтающийся\" голеностопный сустав (в результате\r\nрезекции) суставных поверхностей составляющих его\r\nкостей.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>25\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<p>85 Полный разрыв ахиллова сухожилия 2\r\nСТОПА, ПАЛЬЦЫ НОГ<span>86 \r\n						\r\n						Переломы костей, разрыв связок стопы:<br>\r\nа) \r\n						\r\n						перелом одной-двух костей (кроме боковой кости), разрыв 1\r\n</span></p>\r\n					<p>связок<span>б) \r\n						\r\n						перелом трех и более костей, пяточной кости 5\r\n87 \r\n						\r\n						Переломы, разрывы сухожилий одного или более\r\n</span></p>\r\n					<p>пальцев одной стопы:\r\n</p>\r\n					<p>88 Травматическая ампутация или повреждение,\r\nприведшее к ампутации пальцев ног:\r\n</p>\r\n					<p>а) \r\n						\r\n						большого пальца 2\r\nб) \r\n						\r\n						второго, третьего, четвертого, пятого пальцев - за каждый 1\r\n</p>\r\n					<p>палец\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>перелом или вывих одной или нескольких фаланг,\r\nповреждение сухожилий (полный или частичный разрыв)\r\nодного или более пальцев\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>1\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n			</tbody></table>\r\n			\r\n			\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>89\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Повреждение, повлекшее развитие\r\nпосттравматического тромбофлебита, лимфостаза,\r\nостеомиелита, нарушение трофики\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>1\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>*Примечания: Ст.89 применяется при тромбофлебите, лимфостазе и нарушениях\r\nтрофики, вызванных травмой опорно-двигательного аппарата (за исключением\r\nповреждения крупных периферических сосудов и нервов), через 6 месяцев со дня\r\nтравмы, при подтверждении диагноза на момент выплаты. Нагноительные\r\nвоспаления пальцев не дают оснований для выплаты.\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>90\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Травматический шок или шок, развившийся\r\nвследствие острой кровопотери, связанной с\r\nтравмой (геморрагический шок)\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>5\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>91\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Если в результате несчастного случая, наступившего\r\nв течение срока страхования, получено телесное\r\nповреждение, не предусмотренное настоящей\r\n\"Таблицей\", то страховая выплата производится\r\nисходя из срока непрерывного лечения в ЛПУ,\r\nпрямой причиной которого является указанный\r\nнесчастный случай, что подтверждено\r\nсоответствующей справкой от лечащего врача и\r\nкопией амбулаторной карты за период лечения,\r\nзаверенной медицинского учреждения, где\r\nпроводилось лечение*\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<p>а) амбулаторное лечение от 9 до 14 календарных дней 1\r\nб) \r\n						\r\n						амбулаторное лечение от 15 до 30 календарных дней 3\r\nв) \r\n						\r\n						амбулаторное лечение от 31 календарных дней и более 5\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n		</div>\r\n		<div>\r\n			<table>\r\n				<tbody><tr>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>92\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					<td>\r\n						<div>\r\n							<div>\r\n								<p>Если в результате несчастного случая, наступившего\r\nв течение срока страхования, получено телесное\r\nповреждение, не предусмотренное настоящей\r\n\"Таблицей\" и потребовавшее стационарного\r\nлечения, то страховая выплата производится\r\nисходя из срока непрерывного пребывания на\r\nстационарном лечении, прямой причиной которого\r\nявляется указанный несчастный случай, что\r\nподтверждено соответствующим выписным\r\nэпикризом (копией истории болезни) медицинского\r\nучреждения, где проводилось стационарное\r\nлечение*\r\n</p>\r\n							</div>\r\n						</div>\r\n					</td>\r\n					\r\n				</tr>\r\n			</tbody></table>\r\n			<div>\r\n				<div>\r\n					<p>а) стационарное лечение от 3 до 14 календарных дней 3\r\nб) \r\n						\r\n						стационарное лечение от 15 до 30 календарных дней 5\r\nв) \r\n						\r\n						стационарное лечение от 31 календарных дней и более 10\r\n</p>\r\n					<p>*Примечания: Если в связи с травмой существуют основания для выплаты по ст.\r\n91 и по ст.92, то размер выплаты рассчитывается в зависимости от количества\r\nдней амбулаторного (по ст. 91) и стационарного (по ст.92) лечения.<span>РАЗМЕРЫ СТРАХОВОЙ ВЫПЛАТЫ ПРИ ОЖОГАХ\r\n</span></p>\r\n					<p>(определение размера выплаты по ст.46 настоящей Таблицы в % от\r\n</p>\r\n					<p>страховой суммы)<br>\r\nПлощадь ожога Степень ожога\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<p>в % от поверхности<br>\r\nтела<br>\r\nОжоги мягких тканей волосистой части головы, туловища, конечностей\r\n1-2 1 2 3<span>3-5 2 4 5<span>6-9 \r\n						\r\n						5 \r\n						9 \r\n						10<span>10-20 \r\n						\r\n						15 \r\n						17 \r\n						20<span>21-30 \r\n						\r\n						25 \r\n						28 \r\n						30<span>31-40 \r\n						\r\n						50 \r\n						55 \r\n						60<span>41-60 \r\n						\r\n						70 \r\n						80 \r\n						80<span>61-90 \r\n						\r\n						80 \r\n						100 \r\n						100<span>Более 90 \r\n						\r\n						\r\n						\r\n						100 \r\n						\r\n						100 \r\n						\r\n						100\r\nОжоги мягких тканей лица, передне-боковой поверхности шеи,\r\nподчелюстной области, ушных раковин<span>1-2 5 10 15<span>3-4 10 15 20<span>5-6 15 25 30<span>7-8 20 30 40&nbsp;</span></span></span></span></span></span></span></span></span></span></span></span></p>\r\n				</div>\r\n			</div>\r\n		</div><br>','advantages','','',NULL),(20,NULL,'2022-02-14 11:10:30.121965','2022-02-14 11:10:30.122011',20,1,99,'','Товары','','products','','',NULL),(21,NULL,'2022-02-14 12:18:10.516751','2022-02-14 12:18:23.927368',21,1,99,'','Форма страхования \"Хоккей\" - Для всех','','form_hockey2','','',NULL),(22,NULL,'2022-02-14 12:39:24.696325','2022-02-28 15:56:42.287732',22,1,3,'','Услуги','','products','','',NULL),(23,NULL,'2022-02-15 10:37:29.256392','2022-02-15 10:37:29.256430',23,1,3,NULL,'Круизы',NULL,'cruises',NULL,NULL,NULL),(24,NULL,'2022-02-15 11:02:23.043888','2022-02-15 11:02:23.043927',24,1,99,'','Форма страхования \"Круизы\"','','form_cruises','','',NULL),(25,NULL,'2022-02-28 14:43:25.708422','2022-03-01 11:57:11.744564',25,1,7,'','Каталог','','insurance_products_cruise','','',NULL),(26,NULL,'2022-03-01 09:09:01.336754','2022-03-01 09:09:01.336814',26,1,99,'','Форма обратной связи','','feedback','','',NULL),(27,NULL,'2022-03-01 09:09:26.411367','2022-03-01 09:09:26.411406',27,1,3,'','Написать нам','','feedback','','',NULL),(28,NULL,'2022-03-01 11:56:58.904934','2022-03-01 11:56:58.904991',28,1,99,'','insurance_products_cruise','','insurance_products_cruise','','',NULL),(29,NULL,'2022-03-01 14:36:13.111342','2022-03-01 14:36:13.111397',29,1,3,'','Написать нам','','feedback','','',NULL),(30,NULL,'2022-03-01 15:34:12.637101','2022-03-01 15:37:50.907917',30,1,3,'','Правила страхования','<p><b>Страхование медицинских и иных расходов</b></p><p>Описание (подробности можно дать в выплывающих окнах):</p><p><b>медицинские расходы</b></p><p>- на амбулаторную / стационарную помощь;</p><p>- на экстренную стоматологическую помощь (в пределах 200€)</p><p></p><p><b>медико-транспортные расходы</b></p><p>- на медицинскую эвакуацию автомашиной скорой помощи с места нахождения Застрахованного лица на территории страхования в ближайшее медицинское учреждение;</p><p>- на транспортировку Застрахованного лица из одной клиники в другую;</p><p>- на медицинскую репатриацию Застрахованного лица с территории страхования</p><p><b>расходы по посмертной репатриации</b></p><p>- тела Застрахованного лица;</p><p>- на проезд одного из близких родственников, сопровождающего тело;</p><p><b>транспортные расходы</b></p><p>- на проезд Застрахованного лица до аэропорта, ж/д вокзала на территории страхования;</p><p>- на проезд Застрахованного лица в один конец к месту постоянного проживания;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику Застрахованного лица, если срок госпитализации Застрахованного лица превысил 15 дней;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику несовершеннолетнего Застрахованного лица в случае оставления несовершеннолетнего Застрахованного лица</p><p>без присмотра совершеннолетним лицом, сопровождавшим его в поездке;</p><p>- на оплату перевозки и услуг по подносу багажа Застрахованного лица на территории страхования;</p><p><b>расходы по проживанию</b></p><p>- связанных с проживанием Застрахованного лица в гостинице на территории страхования после окончания стационарного лечения;</p><p>- связанных с проживанием одного близкого родственника в гостинице на территории страхования при госпитализации несовершеннолетнего Застрахованного лица, продолжающейся после даты запланированного возвращения из поездки;</p><p>- связанных с проживанием в гостинице несовершеннолетнего Застрахованного лица, оставшегося без присмотра сопровождающего его совершеннолетнего лица;</p><p>- связанных с проживанием в гостинице одного близкого родственника совершеннолетнего Застрахованного лица в случае госпитализации Застрахованного лица сроком более 15 дней</p><p>Расходы на проживание оплачиваются на срок не более 5 дней (при карантине - на весь срок карантина).</p><p><b>дополнительные расходы</b></p><p>- на телефонные переговоры с Сервисной компанией / Страховщиком по страховому случаю.</p><p><b>ПокрытиеCOVID-19:</b></p><p>Медицинские расходы в период пребывания Застрахованного лица в стационаре и/или в обсерваторе для лиц с лабораторно подтвержденным заболеванием COVID-19</p><p>покрываются в лимите 5000 €.</p><p>Медико-транспортные расходы, расходы по посмертной репатриации, транспортные расходы, расходы по проживанию на территории страхования на период карантина после перенесенного заболеванияCOVID-19 оплачиваются в размере фактически понесенных расходов в лимите страховой суммы, установленной&nbsp; по этим видам помощи договором страхования.</p><p>Не более одного случая в течение срока страхования.</p>','advantages','','',NULL),(31,NULL,'2022-03-01 15:39:45.186289','2022-03-01 15:39:45.186329',31,1,3,'','Страховка от не выезда','<p><b>Страхование отмены поездки</b></p><p></p><p><b>Страховым полисом покрываются расходы из-за невозможности совершить поездку или сокращения срока пребывания в поездке</b></p><p></p><p>по причине:</p><p>- смерти Застрахованного лица /смерти близкого родственника Застрахованного лица;</p><p>- острого заболевания Застрахованного лица, создавшего угрозу для жизни и повлекшего экстренную госпитализацию / нахождение на карантине;</p><p><b>По случаям заболевания Застрахованного лица COVID-19:&nbsp;</b></p><p>Острого заболевания Застрахованного лица, создавшего угрозу для жизни и повлекшего экстренную госпитализацию, а также амбулаторного лечения Застрахованного лица по поводу лабораторно подтверждённого заболевания COVID-19 / нахождения на карантине;</p><p>- острого заболевания близкого родственника Застрахованного лица, создавшего угрозу для жизни и повлекшего его экстренную госпитализацию;</p><p>- травм, полученных Застрахованным лицом в результате несчастного случая;</p><p>- травм, полученных близким родственником Застрахованного лица в результате несчастного случая;</p><p>- участия Застрахованного лица в судебном разбирательстве в период совершения поездки;</p><p>- повреждения / гибели имущества, принадлежащего Застрахованному лицу, на сумму более 500 тыс. руб.;</p><p>- отказа в выдаче визы / задержки выдачи визы / выдачи визы в иные от запрашиваемых сроки Застрахованному лицу;</p><p>-&nbsp; не заблаговременногополучения Застрахованным лицом паспорта с визой от туристической организации или от Консульства государства назначения;</p><p>- получения Застрахованным лицом вызова для выполнения воинских обязанностей в период, совпадающий со сроком поездки;</p><p>- задержки вылета/отмены на территории РФ внутренних стыковочных авиарейсов, являющихся неотъемлемой частью поездки за рубеж;</p><p>- задержки вылета/отмены международного авиарейса из аэропорта на территории РФ, являющегося неотъемлемой частью поездки за рубеж;</p><p>- досрочного возращения Застрахованного лица из поездки, связанного&nbsp;со смертью близкого родственника Застрахованного лица.</p><p></p><p>Страховые тарифы</p><table><tbody><tr><td><p>Страховая сумма на</p><p>1 чел. (EUR)</p></td><td><p>Страховой тариф</p><p>(% от страховой суммы) / страховая премия)</p></td><td><p>Страховой тариф</p><p>для граждан РФ в возрасте от 86 до 90 лет (% от страховой суммы)</p></td></tr><tr><td><p>До 1 000</p></td><td><p>14,25EUR</p></td><td><p>7,50%</p></td></tr><tr><td><p>1 001 – 2 000</p></td><td><p>30,00EUR</p></td></tr><tr><td><p>2 001 – 3 000</p></td><td><p>47,25EUR</p></td></tr><tr><td><p>3 001 – 4 000</p></td><td><p>66,00EUR</p></td></tr><tr><td><p>4 001 – 5 000</p></td><td><p>86,25EUR</p></td></tr><tr><td><p>5 001 – 10 000</p></td><td><p>2,25 %</p></td></tr></tbody></table><p></p><p>Страхование от невыезда оформляется в дополнение к медицинскому страхованию.</p>','advantages','','',NULL),(32,NULL,'2022-03-10 16:44:54.404798','2022-03-15 21:56:25.527815',32,1,3,'','Условия оплаты','<b style=\"background-color: initial;\">Общество с ограниченной ответственностью<br></b><b>«ИНВЕСТ СТРАХОВАНИЕ»<br></b><b>119602,Г.МОСКВА, ВН.ТЕР.Г. МУНИЦИПАЛЬНЫЙ ОКРУГ ТРОПАРЕВОНИКУЛИНО, УЛ ПОКРЫШКИНА, Д. 9, КВ. 375<br></b><b>ИНН/КПП<br></b><b><b>9729319779/772901001ОГРН&nbsp;<b>1227700083335</b></b></b></h4><b><b><b><br><p>Условия оплаты<br>Для покупки страховки на нашем сайте выберите нужное вам покрытие и заполните необходимые поля<br>Для выбора оплаты товара с помощью банковской карты на соответствующей странице необходимо нажать кнопку Оплата заказа банковской картой. Оплата происходит через ПАО СБЕРБАНК с использованием банковских карт следующих платёжных систем:<br>МИР (разместить логотип МИР);<br>VISA International (разместить логотип VISA International);<br>Mastercard Worldwide (разместить логотипMastercard Worldwide);<br>JCB (разместить логотип JCB).<br>Для оплаты (ввода реквизитов Вашей карты) Вы будете перенаправлены на платёжный шлюз ПАО СБЕРБАНК. Соединение с платёжным шлюзом и передача информации осуществляется в защищённом режиме с использованием протокола шифрования SSL. В случае если Ваш банк поддерживает технологию безопасного проведения интернет-платежей Verified By Visa, MasterCard SecureCode, MIR Accept, J-Secure, для проведения платежа также может потребоваться ввод специального пароля.<br>Настоящий сайт поддерживает 256-битное шифрование. Конфиденциальность сообщаемой персональной информации обеспечивается ПАО СБЕРБАНК. Введённая информация не будет предоставлена третьим лицам за исключением случаев, предусмотренных законодательством РФ. Проведение платежей по банковским картам осуществляется в строгом соответствии с требованиями платёжных систем МИР, Visa Int., MasterCard Europe Sprl, JCB.<br><br>&nbsp;<span>Возврат товара&nbsp;Срок возврата товара надлежащего качества составляет 30 дней с момента получения товара.<br>Возврат переведённых средств, производится на ваш банковский счёт в течение 5-30 рабочих дней (срок зависит от банка, который выдал вашу банковскую карту).<br><br><br><br><a href=\"https://disk.yandex.ru/i/BEUw1_CY9TRbhQ\">Политика обработки персональных данны</a><br><br></span></p><p><b>1. Общие положения</b></p><p>Настоящий документ (далее – Политика) определяет цели и общие принципы обработки персональных данных, а также реализуемые меры защиты персональных данных в ООО «<b>ИНВЕСТ СТРАХОВАНИЕ</b>» (далее – Оператор). Политика является общедоступным документом Оператора и предусматривает возможность ознакомления с ней любых лиц.<br><br>Политика действует бессрочно после утверждения и до ее замены новой версией.<br><br>В Политике используются термины и определения в соответствии с их значениями, как они определены в ФЗ-152 \"О персональных данных\".<br><br>Обработка персональных данных Оператора осуществляется с соблюдением принципов и условий, предусмотренных настоящей Политикой и законодательством Российской Федерации в области персональных данных.</p><p><b>2. Правовые основания обработки персональных данных</b></p><p>Обработка персональных данных осуществляется Оператором на законной и справедливой основе, на основании следующих документов:</p><ul><li>Конституция Российской Федерации;</li><li>Трудовой кодекс Российской Федерации;</li><li>Гражданский кодекс Российской Федерации;</li><li>Налоговый кодекс Российской Федерации;</li><li>Федеральный закон от 27.07.2006г. № 152-ФЗ «О персональных данных»;</li><li>Федеральный закон от 06.04.2011г. № 63-ФЗ «Об электронной подписи»;</li><li>Федеральный закон от 04.05.2011г. № 99-ФЗ «О лицензировании отдельных видов деятельности»;</li><li>Федеральный закон от 07.07.2003г. № 126-ФЗ «О связи»;</li><li>Федеральный закон от 01.04.1996г. № 27-ФЗ «Об индивидуальном (персонифицированном) учете в системе обязательного пенсионного страхования»;</li><li>Федеральный закон от 22.10.2004г. № 125-ФЗ «Об архивном деле в РФ»;</li><li>Федеральный закон от 29.12.2012 N 273-ФЗ \"Об образовании в Российской Федерации\";</li><li>Устав ООО <b>«ИНВЕСТ СТРАХОВАНИЕ»</b>.</li></ul><p><b>3. Порядок и условия обработки персональных данных</b></p><p>Обработка персональных данных Оператором ведется смешанным способом, т.е. происходит как, с использованием средств автоматизации, так и без таковых.<br><br>Осуществляются следующие действия с персональными данными: сбор, запись, систематизация, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передача, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных.<br><br>При обработке обеспечиваются точность, достаточность и актуальность персональных данных по отношению к целям их обработки. При обнаружении неточных или неполных персональных данных производится их актуализация.<br><br>Получение и обработка персональных данных в случаях, предусмотренных ФЗ-152, осуществляется Оператором с письменного согласия субъекта персональных данных. Равнозначным согласию в письменной форме на бумажном носителе, содержащему собственноручную подпись субъекта персональных данных, признается согласие в форме электронного документа, подписанного квалифицированной электронной подписью.<br><br>Согласие на обработку персональных данных может быть дано субъектом персональных данных или его представителем в любой позволяющей подтвердить факт его получения форме, если иное не установлено ФЗ-152.<br><br>Обработка специальных категорий персональных данных, касающихся расовой, национальной принадлежности, политических взглядов, религиозных или философских убеждений, интимной жизни, Оператором не осуществляется.<br><br>Сведения, которые характеризуют физиологические особенности человека и на основе которых можно установить его личность (биометрические персональные данные), могут обрабатываться только при наличии согласия в письменной форме субъекта персональных данных.<br><br>Обработка и хранение персональных данных осуществляются не дольше, чем этого требуют цели обработки персональных данных, если отсутствуют законные основания для дальнейшей обработки.<br><br>Обработка персональных данных на основании договоров и иных соглашений Оператора, поручений Оператору и поручений Оператора на обработку персональных данных осуществляется в соответствии с условиями этих договоров, соглашений и поручений. Вышеуказанные документы могут определять, в частности:</p><ul><li>цели, условия, сроки обработки персональных данных;</li><li>обязательства сторон, в том числе меры по обеспечению безопасности персональных данных;</li><li>права, обязанности и ответственность сторон, касающиеся обработки персональных данных.</li></ul><p>В случаях, явно не предусмотренных действующим законодательством или договором, обработка осуществляется после получения согласия субъекта персональных данных. Согласие может быть выражено в форме совершения действий, принятия условий договора-оферты, проставления соответствующих отметок, заполнения полей в формах, бланках, или оформлено в письменной форме в соответствии с законодательством.<br><br>Оператор предпринимает необходимые правовые, организационные и технические меры для обеспечения безопасности персональных данных, их защиты от несанкционированного (в том числе, случайного) доступа, уничтожения, изменения, блокирования доступа и других несанкционированных действий. К таким мерам, в частности, относятся:</p><ul><li>назначение сотрудников, ответственных за организацию обработки и обеспечение безопасности персональных данных;</li><li>проверка наличия в договорах и включение при необходимости в договоры пунктов об обеспечении конфиденциальности персональных данных;</li><li>издание локальных актов по вопросам обработки персональных данных, ознакомление с ними работников, обучение пользователей;</li><li>обеспечение физической безопасности помещений и средств обработки, пропускной режим, охрана, видеонаблюдение;</li><li>ограничение и разграничение доступа сотрудников и иных лиц к персональным данным и средствам обработки, мониторинг действий с персональными данными;</li><li>определение угроз безопасности персональных данных при их обработке, формирование на их основе моделей угроз;</li><li>применение средств обеспечения безопасности (антивирусных средств, межсетевых экранов, средств защиты от несанкционированного доступа, средств криптографической защиты информации), в том числе прошедших процедуру оценки соответствия в установленном порядке;</li><li>учёт и хранение носителей информации, исключающее их хищение, подмену, несанкционированное копирование и уничтожение;</li><li>резервное копирование информации для возможности восстановления;</li><li>осуществление внутреннего контроля за соблюдением установленного порядка, проверка эффективности принятых мер, реагирование на инциденты.</li></ul><p><b>4. Права субъектов персональных данных</b></p><p>Субъект персональных данных имеет право отозвать согласие на обработку персональных данных, направив соответствующий запрос Оператору по почте или обратившись лично.<br><br>Субъект персональных данных имеет право на получение информации, касающейся обработки его персональных данных, в том числе содержащей:</p><ul><li>подтверждение факта обработки персональных данных Оператором;</li><li>правовые основания и цели обработки персональных данных;</li><li>цели и применяемые Оператором способы обработки персональных данных;</li><li>наименование и место нахождения Оператора, сведения о лицах (за исключением сотрудников/работников Оператора), которые имеют доступ к персональным данным или которым могут быть раскрыты персональные данные на основании договора с Оператором или на основании федерального закона;</li><li>обрабатываемые персональные данные, относящиеся к соответствующему субъекту персональных данных, источник их получения, если иной порядок представления таких данных не предусмотрен федеральным законом;</li><li>сроки обработки персональных данных, в том числе сроки их хранения;</li><li>порядок осуществления субъектом персональных данных прав, предусмотренных Федеральным законом \"О персональных данных\";</li><li>информацию об осуществленной или о предполагаемой трансграничной передаче данных;</li><li>наименование или фамилию, имя, отчество и адрес лица, осуществляющего обработку персональных данных по поручению Оператора, если обработка поручена или будет поручена такому лицу;</li><li>иные сведения, предусмотренные Федеральным законом \"О персональных данных\" или другими федеральными законами.</li></ul><p>Субъект персональных данных вправе требовать от Оператора уточнения его персональных данных, их блокирования или уничтожения в случае, если персональные данные являются неполными, устаревшими, неточными, незаконно полученными или не являются необходимыми для заявленной цели обработки, а также принимать предусмотренные законом меры по защите своих прав.<br><br>Если субъект персональных данных считает, что Оператор осуществляет обработку его персональных данных с нарушением требований Федерального закона \"О персональных данных\" или иным образом нарушает его права и свободы, субъект персональных данных вправе обжаловать действия или бездействие Оператора в уполномоченный орган по защите прав субъектов персональных данных (Федеральная служба по надзору в сфере связи, информационных технологий и массовых коммуникаций - Роскомнадзор) или в судебном порядке.<br><br>Субъект персональных данных имеет право на защиту своих прав и законных интересов, в том числе на возмещение убытков и (или) компенсацию морального вреда в судебном порядке.</p><p><b>5. Права и обязанности Оператора</b></p><p>Права и обязанности Оператора определяются действующим законодательством и соглашениями Оператора.<br><br>Контроль исполнения требований настоящей Политики осуществляется ответственным за организацию обработки персональных данных.<br><br>Ответственность лиц, участвующих в обработке персональных данных на основании поручений Оператора, за неправомерное использование персональных данных устанавливается в соответствии с условиями заключенного между Оператором и контрагентом гражданско-правового договора или Соглашения о конфиденциальности информации.<br><br>Лица, виновные в нарушении норм, регулирующих обработку и защиту персональных данных, несут материальную, дисциплинарную, административную, гражданско-правовую или уголовную ответственность в порядке, установленном федеральными законами, локальными актами, соглашениями Оператора.<br><br>Политика обработки персональных данных разрабатывается ответственным за организацию обработки персональных данных и вводится в действие после утверждения руководителем Оператора. Предложения и замечания для внесения изменений в Политику следует направлять по адресу&nbsp;tlogdir@gmail.com. Политика пересматривается ежегодно для поддержания в актуальном состоянии и актуализируется по мере необходимости.</p><br><p></p></b></b></b>','advantages','','',NULL),(33,NULL,'2022-03-15 14:45:12.012573','2022-03-15 14:45:12.023162',33,1,3,'','Контакты','Вы можете связаться с нашими специалистами и получить необходимую информацию<br>','contacts','','',NULL),(34,NULL,'2022-03-25 15:23:53.025279','2022-07-26 17:33:53.254599',34,1,3,'','От не выезда','<p>\r\n		\r\n	\r\n	\r\n		<div>\r\n			<div>\r\n				<div>\r\n					<p>УСЛОВИЯ СТРАХОВАНИЯ ГРАЖДАН, ВЫЕЗЖАЮЩИХ ЗА ПРЕДЕЛЫ ПОСТОЯННОГО МЕСТА ЖИТЕЛЬСТВА\r\n</p>\r\n					<p>Программа страхования / G1\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<p>Страховой риск\r\n</p>\r\n				</div>\r\n				<div>\r\n					<p>Медицинские и иные расходы / Medical and other expenses\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>Определения<br>\r\nБлизкими родственниками, на условиях настоящего Договора страхования, являются супруги, дети (в том числе\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>усыновленные), родители, а также родные сестры и братья.<span>Путешествие (Круиз) – туристическая поездка, подтвержденная транспортными билетами (авиа-, ж/д-, автобусные билеты,\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>билеты на водный транспорт) и документами на проживание в этой поездке, оформленными на Застрахованное лицо.<span>Туристский продукт - комплекс услуг по перевозке и размещению, оказываемых за общую цену (независимо от включения в\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>общую цену стоимости экскурсионного обслуживания и (или) других услуг) по договору о реализации туристского продукта.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медицинская помощь – комплекс мероприятий, направленных на поддержание и (или) восстановление здоровья и включающих\r\nв себя предоставление медицинских услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медицинские услуги – медицинское вмешательство или комплекс медицинских вмешательств, направленных на профилактику,\r\nдиагностику, лечение заболеваний и медицинскую реабилитацию и имеющих самостоятельное законченное значение.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Формы оказания медицинской помощи:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- экстренная - медицинская помощь, оказываемая при внезапных острых заболеваниях, состояниях, обострении хронических\r\nзаболеваний, представляющих угрозу жизни пациента;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- неотложная - медицинская помощь, оказываемая при внезапных острых заболеваниях, состояниях, обострении хронических\r\nзаболеваний без явных признаков угрозы жизни пациента;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- плановая - медицинская помощь, которая оказывается при проведении профилактических мероприятий, при заболеваниях и\r\nсостояниях, не сопровождающихся угрозой жизни пациента, не требующих экстренной и неотложной медицинской помощи, и отсрочка\r\nоказания которой на определенное время не повлечет за собой ухудшение состояния пациента, угрозу его жизни и здоровью.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Скорая медицинская помощь, в том числе скорая специализированная - вид медицинской помощи, оказывается при\r\nзаболеваниях, несчастных случаях, травмах, отравлениях и других состояниях, требующих срочного медицинского вмешательства.\r\nСкорая, в том числе скорая специализированная, медицинская помощь оказывается в экстренной или неотложной форме вне\r\nмедицинской организации, а также в амбулаторных и стационарных условиях.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Условия оказания медицинской помощи:<br>\r\n- вне медицинской организации;<br>\r\n- амбулаторно (в условиях, не предусматривающих круглосуточного медицинского наблюдения и лечения), в том числе на дому\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>при вызове медицинского работника;<span>- в дневном стационаре (в условиях, предусматривающих медицинское наблюдение и лечение в дневное время, но не\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>требующих круглосуточного медицинского наблюдения и лечения);<span>- стационарно (в условиях, обеспечивающих круглосуточное медицинское наблюдение и лечение).<span>Острое заболевание/состояние – внезапное нарушение функции или строения органов и тканей, возникающее под влиянием\r\n</span></span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>внешних или внутренних факторов, требующее безотлагательного вмешательства медицинского специалиста и проведения лечения в\r\nближайшие часы после возникновения первых симптомов.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Экстренная госпитализация –<br>\r\nспециализированной медицинской помощи<br>\r\nхронических болезней, иных острых заболевания/состояний), в том числе травм, отравлений, ожогов, угрожающих жизни и требующих\r\nинтенсивной терапии и круглосуточного медицинского наблюдения.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>госпитализация в стационар направленная на оказание экстренной\r\nв случаях: острой хирургической патологии или острых заболеваний (обострения\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Плановая госпитализация – заранее согласованная госпитализация в круглосуточный стационар, допускающая возможную\r\nочередность и осуществляющаяся по направлению лечащего врача для прохождения комплексного обследования, лечения, включая\r\nхирургическое, при состояниях, не представляющих непосредственную угрозу для жизни человека, отсрочка в выполнении которых не\r\nвлечет за собой возникновения необратимых последствий и осложнений для организма человека.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1. Страховые случаи.<span>В соответствии с настоящими Условиями страхования граждан по Программе страхования «G1» (далее – Условия страхования)\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>согласно Правилам страхования граждан, выезжающих за пределы постоянного места жительства, от 11.06.2020 г. (далее – Правила\r\nстрахования), договор страхования заключен на случай реализации следующих рисков:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1. Возникновение расходов из-за невозможности совершить поездку или сокращения срока пребывания в поездке:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1. Возникновение расходов из-за невозможности совершить поездку за границы территории РФ или за пределы\r\nтерритории постоянного места жительства на территории РФ по причине:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.1. смерти Застрахованного лица /смерть близкого родственника Застрахованного лица в период действия договора\r\nстрахования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.2. острого заболевания/состояния Застрахованного лица, создавшего угрозу для жизни и повлекшего экстренную\r\nгоспитализацию / нахождение на карантине, состоявшиеся и имеющие место на дату начала поездки Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>По случаям заболевания Застрахованного лица коронавирусной инфекцией COVID-19:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>острого заболевания/состояния Застрахованного лица, создавшего угрозу для жизни и повлекшего экстренную госпитализацию,\r\nсостоявшиеся и имеющие место не ранее 2-х месяцев до даты начала запланированной поездки (включая дату начала поездки)\r\nЗастрахованного лица, а также амбулаторного лечения Застрахованного лица по поводу лабораторно подтверждённого заболевания\r\nкоронавирусной инфекцией COVID-19 / нахождения на карантине – при условии предъявления Страховщику предписания в отношении\r\nЗастрахованного лица, выданного Роспотребнадзором / медицинским учреждением, с датой выдачи предписания не ранее 2-х месяцев\r\nдо даты предполагаемой поездки (включая дату начала поездки);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.3. травм (произошедших и имеющих место на дату начала поездки), полученных Застрахованным лицом в результате\r\nнесчастного случая, препятствующих совершению предполагаемой поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.4. острого заболевания/состояния близкого родственника Застрахованного лица, создавшего угрозу для жизни и\r\nповлекшего его (близкого родственника) экстренную госпитализацию, состоявшуюся и имеющую место на дату начала поездки\r\nсовершеннолетнего Застрахованного лица;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.5. травм, полученных близким родственником совершеннолетнего Застрахованного лица в результате несчастного случая\r\nв период действия договора страхования и повлекших необходимость обеспечения ему (близкому родственнику) ухода (патронажа)\r\nсилами совершеннолетнего Застрахованного лица на дату начала поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.6. участия Застрахованного лица в судебном разбирательстве (судебном заседании) в период совершения поездки, о\r\nкотором Застрахованное лицо не было уведомлено надлежащим образом компетентными органами в соответствии с законодательством\r\nРФ на дату заключения договора страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.7. повреждения или гибели имущества (кроме транспортного средства), принадлежащего Застрахованному лицу, на сумму\r\nболее 500 (пятисот) тысяч рублей в результате пожара, стихийного бедствия, протечек, связанных с авариями в водопроводных,\r\nканализационных, отопительных системах, а также причинения ущерба имуществу (кроме транспортного средства) Застрахованного\r\nлица в результате противоправных действий третьих лиц;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.8. отказа в выдаче визы (въездной или транзитной) / не заблаговременной выдачи (задержки выдачи) визы (въездной или\r\nтранзитной) / выдачи визы (въездной или транзитной) в иные от запрашиваемых сроки Консульством (Посольством) Застрахованному</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>лицу при заблаговременной подаче в Консульство (Посольство) государства назначения полного комплекта должным образом\r\nоформленных документов, и при условии отсутствия отказа в визе (по любой причине) в любую из визовых стран на протяжении 12\r\n(двенадцати) месяцев, предшествующих запланированной поездке.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- Перечень необходимых документов и требования к ним, а также минимальный срок их (документов) подачи до предполагаемой\r\nдаты выезда, устанавливаются согласно сложившейся консульской практике государства назначения в соответствии с информацией,\r\nразмещённой на официальном сайте Консульства (Посольства);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- Документы на оформление визы должны быть поданы Застрахованным лицом или его законным представителем в Консульство\r\n(Посольство), расположенное на территории РФ, или дистанционно (в электронном виде) через официальный сайт Консульства\r\n(Посольства) государства назначения;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- Факт отказа в выдаче визы и/или факт не заблаговременной выдачи визы Консульством (Посольством) должен быть\r\nподтвержден Застрахованным лицом документально;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.9. не заблаговременного получения Застрахованным лицом паспорта с визой (въездной или транзитной) от туристической\r\nорганизации (туроператора/турагентства) или от Консульства (Посольства) государства назначения на территории РФ при соблюдении\r\nпорядка и срока подачи документов на визу согласно пункту 1.1.1.8 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом факт не заблаговременного получения паспорта с визой из Консульства (Посольства) должен быть подтвержден\r\nЗастрахованным лицом документально;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.10. получения Застрахованным лицом вызова для выполнения воинских обязанностей в период, совпадающий со сроком\r\nпоездки, при условии, что повестка вручена Застрахованному лицу после заключения договора страхования, и Застрахованное лицо\r\nприбыло к месту службы или к месту выполнения воинских обязанностей;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.11. задержки вылета/отмены на территории РФ внутренних стыковочных авиарейсов, являющихся неотъемлемой частью\r\nпоездки за рубеж согласно договору о реализации туристского продукта/туристских услуг, в связи с технической неисправностью\r\nтранспортного средства или экстремальными погодными условиями, что помешало Застрахованному лицу осуществить\r\nзапланированную поездку за рубеж;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.12. задержки вылета/отмены международного авиарейса из аэропорта на территории РФ, являющегося неотъемлемой\r\nчастью поездки за рубеж согласно договору о реализации туристского продукта/туристских услуг, в связи с технической неисправностью\r\nтранспортного средства или экстремальными погодными условиями, что сделало невозможным Застрахованному лицу осуществить\r\nзапланированную им поездку за границы РФ. Отказ от поездки по этой причине должен состоятся до прохождения Застрахованным\r\nлицом пограничного контроля в стране выезда в поездку (п.7.16.1 настоящих Правил страхования).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.13. отказ одного или нескольких Застрахованных лиц осуществить совместную групповую поездку (тур) при наступлении\r\nс одним из Застрахованных лиц – участников совместной групповой поездки (тура) события согласно пунктов 1.1.1.1 - 1.1.1.12 настоящих\r\nУсловий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Совместная групповая поездка (тур) – это поездка, в которой все её участники объединены одним договором о реализации\r\nтуристского продукта/туристских услуг и имеют единые условия и срок пребывания на территории страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом, территория страхования и дата окончания действия ответственности Страховщика по страховому риску пункта 1.1.1\r\nнастоящих Условий страхования определяется следующим образом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом поездки по территории РФ – до пересечения/ выезда из границ 100 км зоны от\r\nадминистративной границы населенного пункта ПМЖ на территории РФ;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом поездки за границы РФ – до пересечения границы РФ (выезда из РФ);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом путешествия (круиза) из любой страны - до пересечения границы страны (въезда\r\nв страну), из которой начинается путешествие (круиз) согласно условиям договора о реализации туристского продукта/туристских\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>услуг. 1.1.2. Возникновение расходов из-за сокращения срока пребывания в поездке: досрочное возращение\r\nЗастрахованного лица из поездки, связанное со смертью близкого родственника Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Если в случае досрочного возвращения из поездки совершеннолетнего Застрахованного лица, несовершеннолетние\r\nЗастрахованные лица, находящиеся с ним в одной поездке, но не являющиеся при этом близкими родственниками умершему, и\r\nостающиеся с отъездом совершеннолетнего Застрахованного лица без присмотра, Страховщиком оплачиваются транспортные расходы\r\nв отношении данных несовершеннолетних Застрахованных лиц:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- на проезд до аэропорта, железнодорожного вокзала на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- на проезд в один конец к месту постоянного проживания (страны гражданства) в соответствии с пунктом 6.5.2 настоящих\r\nУсловий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Способы транспортировки, маршруты перемещения лиц определяются Сервисной компанией по согласованию со Страховщиком,\r\nпри этом Страховщик не возмещает расходы, вызванные несоблюдением перевозчиком транспортного расписания.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом, дата начала действия ответственности Страховщика и территория страхования по страховому риску пункта 1.1.2\r\nнастоящих Условий страхования определяется следующим образом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом поездки по территории РФ – с даты начала поездки согласно условиям договора о\r\nреализации туристского продукта/туристских услуг, но после пересечения 100 км зоны от административной границы населенного\r\nпункта ПМЖ на территории РФ;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом поездки за границы РФ – с даты начала поездки согласно условиям договора о\r\nреализации туристского продукта/туристских услуг и при нахождении Застрахованного лица на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- при осуществлении Застрахованным лицом путешествия (круиза) из любой страны – с даты начала путешествия (круиза) и при\r\nусловии нахождения Застрахованного лица в поездке (на борту транспортного средства или в отеле) на маршруте путешествия (круиза)\r\nсогласно договору о реализации туристского продукта/туристских услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2. Основания для отказа в страховой выплате. Расходы, не возмещаемые Страховщиком.<br>\r\n2.1. Страховщик не возмещает расходы Застрахованного лица в связи с возникновением расходов из-за\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>невозможности совершить поездку:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.1. по любым иным событиям, за исключением перечисленных в пункте 1.1.1 настоящих Условий страхования;<br>\r\n2.1.2. по поводу события, предусмотренного пунктами 1.1.1.8, 1.1.1.9 настоящих Условий страхования, если:<br>\r\n2.1.2.1. документы для получения визы (въездной или транзитной) были поданы гражданином РФ / гражданином РФ, имеющим\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>двойное гражданство / иным лицом, имеющим вид на жительство в РФ - в Консульство (Посольство) государства назначения,\r\nрасположенное на территории любых иных государств, кроме РФ;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.2.2. документы для получения визы (въездной или транзитной) были поданы иностранным гражданином - в Консульство\r\n(Посольство) государства назначения, расположенное на территории любого государства, в том числе – РФ, за исключением страны\r\nгражданства;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.2.3. отказ в выдачи визы (въездной или транзитной) был дан по причине нарушения законодательства государства\r\nвременного пребывания в прошлых поездках, в том числе по причине нарушения визового режима, а также по причине нарушения\r\nправил получения и/или выдачи визы в страну тура/поездки: срок подачи на визу, комплектность документов, цель поездки, срок визы,\r\nиные требования, размещенные на официальном сайте Посольства / Консульства / Визового кодекса ЕС (для шенгенской визы);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.2.4. в комплекте документов к заявлению на страховую выплату отсутствует решение Консульства (Посольства) по поданному\r\nкомплекту документов на получение визы либо Консульство (Посольство) вернуло паспорт без визы с рекомендацией подачи комплекта\r\nдокументов на визу на территории иного государства;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.2.5. отказ в выдаче визы был дан при первом обращении за получением визы в страну въезда по действующему на момент</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>обращения за визой загранпаспорту;<br>\r\n2.1.3. в связи со смертью близкого родственника Застрахованного лица, наступившей ранее 15 календарных дней до даты начала\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>поездки, включая дату начала поездки (согласно договору о реализации туристского продукта/ туристских услуг / проездным\r\nдокументам);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.4. по случаям плановой госпитализации Застрахованного лица / близкого родственника Застрахованного лица;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.5. если отмена поездки была по причине неблагоприятной эпидемиологической обстановки по поводу коронавирусной\r\nинфекции COVID-19 в стране планируемой поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.6. если в страну поездки въезд не разрешен (в том числе с целью туризма) и/или со страной прекращено авиасообщение\r\nввиду распространения коронавирусной инфекции COVID-19 на территории страны/стран поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.1.7. если страна планируемой поездки находилась в списке стран, запрещенных / ограниченных к посещению гражданами РФ.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.2. Страховщик не возмещает расходы в связи с досрочным возвращением из поездки:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.2.1. иным Застрахованным лицам, находящимся в одной поездке (согласно договору о реализации туристского\r\nпродукта/туристских услуг) с Застрахованным лицом, досрочное возвращение которого было организовано Страховщиком по причине\r\nсмерти его близкого родственника, за исключением случаев, изложенных в пункте 1.1.2 настоящих Условий страхования в отношении\r\nнесовершеннолетних Застрахованных лиц;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.2.2. любые расходы, вызванные несоблюдением перевозчиком транспортного расписания.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3 Страховщик вправе отказать в страховой выплате в следующих случаях:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3.1. в случае выполнения Страховщиком своих обязательств по договору страхования в полном объеме;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3.2. в случае ликвидации Страхователя – юридического лица, также в случае реорганизации Страхователя - юридического лица\r\nв порядке, установленном действующим законодательством, если Застрахованное лицо или иное лицо в соответствии с действующим\r\nзаконодательством не приняли на себя обязанности Страхователя по договору страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3. Ответственность Страховщика по договору страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1. Ответственность Страховщика по договору страхования на случай возникновения расходов из-за невозможности совершить\r\nпоездку или сокращения срока пребывания в поездке:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.1. в части возникновения расходов, возникших из-за невозможности совершить поездку, начинается с 00:00 часов дня,\r\nуказанного в договоре (полисе) страхования как день начала действия договора страхования, но не ранее дня уплаты Страхователем\r\nстраховой премии, и заканчивается:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>а) Для международных поездок (с пересечением границы РФ):\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- для авиарейсов - в момент прохождения Застрахованного лица пограничного контроля в РФ при выезде на территорию\r\nстрахования по маршруту согласно проездным документам;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Если поездка по договору о реализации туристского продукта/туристских услуг включает стыковочные рейсы по территории РФ\r\n– в момент регистрации Застрахованного лица на стыковочный рейс по маршруту согласно проездным документам;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- для железнодорожного, водного транспорта – в момент выхода Застрахованного лица на перрон (причал) после объявления\r\nпосадки на транспортное средство;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- для прочих видов транспорта – в момент посадки Застрахованного лица в транспортное средство;<br>\r\nб) Для поездок внутри РФ (без пересечения границы РФ):<br>\r\n- для авиарейсов – в момент регистрации Застрахованного лица на авиарейс;<br>\r\n- для железнодорожного, водного транспорта – в момент выхода Застрахованного лица на перрон (причал) после объявления\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>посадки на транспортное средство;<br>\r\n- для прочих видов транспорта – в момент посадки Застрахованного лица в транспортное средство;<br>\r\n3.1.2. в части возникновения расходов, возникших в связи с сокращением срока пребывания в поездке, начинается с 00:00 часов\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>дня, указанного в договоре (полисе) страхования как день начала действия договора страхования, но не ранее дня уплаты\r\nСтрахователем страховой премии, и заканчивается не позднее 24:00 часов по местному времени территории страхования даты\r\nокончания срока действия договора страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4. Порядок взаимодействия сторон при наступлении страхового случая.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.1. При наступлении события, предусмотренного договором (полисом) страхования и имеющего признаки страхового случая,\r\nпредусмотренного пунктом 1.1.1 настоящих Условий страхования, Застрахованное лицо обязано:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.1.1. незамедлительно, как только станет известно о невозможности совершить поездку, заявить турагенту (туроператору) по\r\nместу покупки тура /поездки об отказе от тура (о невозможности совершить поездку) с обязательным указанием причины, по которой\r\nпоездка стала невозможной;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.1.2. в случае, если поездка была организована Застрахованным лицом самостоятельно - незамедлительно обратиться в\r\nтранспортную компанию для своевременной сдачи билетов, предпринять действия по аннулированию брони на проживание на\r\nтерритории страхования (согласно проездным документам);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.2. При наступлении события, предусмотренного договором (полисом) страхования и имеющего признаки страхового случая,\r\nпредусмотренного пунктом 1.1.2 настоящих Условий страхования, Застрахованное лицо должно обратиться в Сервисную компанию для\r\nорганизации процедуры по досрочному возвращению Застрахованного лица из поездки.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5. Перечень документов для осуществления страховой выплаты по страховым случаям.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1. При наступлении события, имеющего признаки страхового случая, предусмотренного пунктами 1.1.1, 1.1.2 настоящих\r\nУсловий страхования, Застрахованное лицо должно предоставить в срок до 35 календарных дней после даты окончания\r\nзапланированной поездки оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- договор (полис) страхования и Условия страхования (приложение к договору (полису) страхования);<br>\r\n- копия паспорта / документа, удостоверяющего личность Застрахованного лица (Выгодоприобретателя);<br>\r\n- оригиналы всех документов, подтверждающих факт понесенных Застрахованным лицом расходов;<br>\r\n- письменное согласие на получение Страховщиком из медицинского учреждения данных Застрахованного лица, составляющих\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>врачебную тайну, и персональных данных;<br>\r\n- заграничный паспорт Застрахованного лица, не выехавшего в поездку (все страницы);<br>\r\n- оригинал или заверенная туристической компанией копия договора о реализации туристского продукта/туристских услуг; при\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>самостоятельной организации поездки – документы, подтверждающие стоимость и факт оплаты проживания (брони номера) в отеле на\r\nтерритории страхования, проездных документов, трансфера, визы;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- оригиналы документов, подтверждающих оплату договора о реализации туристского продукта/туристских услуг;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- справка туроператора (предоставляется туроператором по запросу Страховщика) о расходах, понесенных Застрахованным\r\nлицом, с указанием размера штрафных санкций за аннулирование тура, официально заверенная уполномоченным сотрудником\r\nтуроператора;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документы от туроператора (предоставляются туроператором по запросу Страховщика), подтверждающие сумму удержания\r\nтуроператором по туру, связанную с аннулированием проездных документов, с отказом от номера в отеле, забронированного и\r\nоплаченного туроператором, стоимости трансфера и стоимости оформления визы в консульстве страны назначения, официально\r\nзаверенные уполномоченным сотрудником туроператора. При самостоятельной организации тура – подтверждающие документы об\r\nоплаченных туристских услугах с указанием штрафных санкций;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документы и сведения, необходимые для установления характера страхового события, а именно:\r\n5.1.1. При невозможности совершить поездку при:</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>- неполучении визы по причине отказа в выдаче визы - документально подтверждённый отказ консульской службы и/или копия\r\nстраницы загранпаспорта, содержащей штамп консульства о приеме документов. Если виза выдается в электронном виде –\r\nподтверждение невыдачи визы от туроператора или уполномоченного посредника;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- несвоевременной выдачи (задержки выдачи) визы/ выдачи визы в иные от запрашиваемых сроки – документ, подтверждающий\r\nданное событие,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- несвоевременном получения Застрахованным лицом паспорта с визой (от туристической организации\r\n(туроператора/турагентства) или от Консульства (Посольства) государства назначения на территории РФ - документ, подтверждающий\r\nданное событие.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.2. при невозможности совершить поездку вследствие заболевания, травмы или смерти Застрахованного лица / близкого\r\nродственника Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случае заболевания или травмы – листок временной нетрудоспособности (или его копия) / справка установленного образца\r\n(для детей, учащихся, пенсионеров, неработающих, военнослужащих) из медицинского учреждения РФ с указанием даты заболевания,\r\nдиагноза, выписка из амбулаторной карты, оформленная надлежащим образом и удостоверяющая обращение Застрахованного\r\nлица/близкого родственника Застрахованного лица в медицинское учреждение;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случае стационарного лечения – выписка из истории болезни, оформленная надлежащим образом;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случае смерти - свидетельство о смерти, документы, подтверждающие родственную связь Застрахованного лица и его\r\nблизкого родственника;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.3. при невозможности совершить поездку вследствие судебного разбирательства - судебная повестка / извещение о вызове\r\nв суд, оформленные в установленном порядке,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.4. при невозможности совершить поездку вследствие повреждения или гибели имущества, принадлежащего\r\nЗастрахованному лицу – документы из компетентных органов (пожарной охраны, органов внутренних дел, аварийных служб) и\r\nэкспертных организаций, подтверждающие факт причинения ущерба и размер причиненного ущерба имуществу Застрахованного лица;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.5. при невозможности совершить поездку вследствие получения вызова для выполнения воинских обязанностей – повестка\r\nо призыве Застрахованного лица на срочную военную службу либо военные сборы, оформленная в установленном порядке, а также\r\nподтверждения явки в военкомат / прибытия к месту выполнения воинских обязанностей;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.6. при невозможности совершить поездку вследствие задержки вылета/отмены авиарейса - справка о задержке\r\nвылета/отмене авиарейса от компании – перевозчика с обязательным указанием причины задержки вылета/отмены;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1.7. при досрочном возращении Застрахованного лица из поездки, связанном со смертью близкого родственника\r\nЗастрахованного лица, а также при досрочном возвращении несовершеннолетнего Застрахованного лица, находящегося в одной\r\nпоездке и остающегося без присмотра любым из совершеннолетних Застрахованных лиц:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документы, подтверждающие смерть близкого родственника;<br>\r\n- документы, подтверждающие факт и степень родства;<br>\r\n- документ, подтверждающий оплату проезда на такси (или иным транспортным средством) с указанием фамилии, имени, даты\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>поездки, оплаченной суммы, места отправления и назначения;<br>\r\n- авиа / железнодорожный билет;<br>\r\n- первичный билет и документ, подтверждающий сумму полученного возврата за сданный первичный билет;<br>\r\n- документы от туроператора о фактической стоимости неиспользованных дней проживания в отеле и стоимости трансфера в\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>обратную сторону (предоставляются туроператором по запросу Страховщика).<br>\r\n5.2. Дополнительно в отношении несовершеннолетних и/или недееспособного Застрахованного лица представитель\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Застрахованного лица должен предоставить следующие документы:<br>\r\n- копия свидетельства о рождении Застрахованного лица;<br>\r\n- паспорт Застрахованного лица для лиц старше 14-ти лет;<br>\r\n- копия паспорта Заявителя – одного из родителей (опекуна, попечителя) Застрахованного лица;<br>\r\n- для попечителей и опекунов Застрахованного лица - к пакету документов на страховую выплату прилагается копия документа,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>удостоверяющего данный статус.<br>\r\n5.2.1. В случае смерти Застрахованного лица Заявитель дополнительно предоставляет:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документ, удостоверяющий личность, в случае, если он является Выгодоприобретателем, указанным в договоре (полисе)\r\nстрахования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документ, удостоверяющий личность и свидетельство о праве на наследство, если он является наследником по закону.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6. Страховая выплата. Порядок определения размера и осуществления страховой выплаты по страховому случаю.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.1. Страховщик производит оплату расходов Застрахованного лица при наступлении события, являющегося страховым случаем\r\nв соответствии с настоящими Условиями страхования, и определенного в договоре (полисе) страхования. Расчет суммы страхового\r\nвозмещения осуществляется на основании оригиналов документов, перечисленных в разделе 5 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.2. В течение 45 календарных дней с даты получения всех надлежащим образом оформленных оригиналов документов,\r\nнеобходимых и достаточных для осуществления выплаты страхового возмещения по страховому риску, а также письменных документов,\r\nзапрошенных Страховщиком по согласованию с Застрахованным лицом (Выгодоприобретателем), устанавливающих факт наступления\r\nстрахового случая, Страховщик составляет страховой акт на выплату страхового возмещения по договору страхования граждан,\r\nвыезжающих за пределы постоянного места жительства (далее – страховой акт), признавая тем самым произошедшее событие\r\nстраховым случаем, или принимает решение об отказе в страховой выплате и письменно сообщает Застрахованному лицу об основаниях\r\nпринятия решения об отказе в выплате со ссылками на нормы права и/или условия договора страхования и правил страхования, в\r\nтечение 3 рабочих дней после принятия решения об отказе в выплате.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.3. В течение 10 рабочих дней после составления страхового акта Страховщик осуществляет страховую выплату.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.3.1. Страховая выплата по страховому полису производится Страховщиком в денежной форме в рублях по курсу ЦБ РФ,\r\nустановленному для валюты, указанной в страховом полисе на дату наступления страхового случая (или по курсу ЦБ РФ, установленному\r\nдля валюты, в которой были заявлены Застрахованным лицом расходы на возмещение – если валюта заявленных к возмещению расходов\r\nне совпадает с валютой, указанной в страховом полисе).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом, при расчете страхового возмещения в рублевом эквиваленте, данное условие применяется в случае, если курс\r\nиностранной валюты, указанной в страховом полисе (или курс иной валюты, в которой заявлены расходы на возмещение), не превышает\r\nмаксимального курса.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Под максимальным курсом понимается курс соответствующей иностранной валюты, установленный ЦБ РФ на дату выплаты\r\nстрахового возмещения, увеличенной на 1 (один) процент за каждый месяц (в т.ч. неполный), прошедший с момента наступления\r\nстрахового случая до даты выплаты страхового возмещения. В случае если курс иностранной валюты, установленный ЦБ РФ на дату\r\nнаступления страхового случая, превысит вышеуказанный максимальный курс, размер страхового возмещения определяется исходя из\r\nмаксимального курса.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Под датой наступления страхового случая понимается дата возникновение расходов при оказании страховой (медицинской или\r\nиной) услуги Застрахованному лицу.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.4. Страховая выплата осуществляться путем безналичного перечисления на счет Застрахованного лица (Выгодоприобретателя,\r\nзаконного представителя Застрахованного лица) либо выдается Застрахованному лицу (Выгодоприобретателю, законному\r\nпредставителю Застрахованного лица) наличными деньгами в кассе Страховщика.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.5. При наступлении страхового события, указанного в пункте 1.1 настоящих Условий страхования в части возникновения\r\nрасходов из-за невозможности совершить поездку или сокращения срока пребывания в поездке, Страховщик возмещает фактически\r\nпонесенные расходы за услуги, оплаченные Страхователем/Застрахованным лицом по договору о реализации туристского</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>продукта/туристских услуг и принятых на страхование по договору (полису) страхования в отношении каждого Застрахованного лица:\r\n6.5.1. возмещаются расходы в размере фактически оплаченной стоимости услуг по договору о реализации туристского\r\nпродукта/туристских услуг за вычетом сумм, возвращенных (или причитающих к возврату) Застрахованному лицу\r\nтуроператором/турагентом по компенсации убытков Застрахованного лица, связанных с аннулированием проездных документов,\r\nотказом от забронированного номера в отеле, а также других услуг по организации тура/поездки, оплаченных по договору о реализации\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>туристского продукта/туристских услуг.<br>\r\nПри этом не подлежат возмещению расходы:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- за услуги по договору о реализации туристского продукта/туристских услуг сверх суммы, установленной туроператором как\r\nстоимость тура/поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- турагента/туроператора по оформлению визы, включая консульский сбор (если данная услуга была оказана, а консульский\r\nсбор был уплачен).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.5.2. при досрочном возвращении из поездки возмещаются расходы:<br>\r\n- на проезд Застрахованного лица до аэропорта / вокзала (на территории страхования);<br>\r\n- на проезд Застрахованного лица к месту постоянного проживания: в случаях совершения поездки за границами РФ: до\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>международного транспортного узла (аэропорта, железнодорожного вокзала), с которым имеется прямое сообщение. При отсутствии\r\nпрямого сообщения между территорией страхования и международным транспортным узлом на территории РФ или в стране\r\nгражданства, включая стыковочные рейсы между транспортными узлами на территориях иных государств; в случаях совершения\r\nпоездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на территории РФ или в стране\r\nгражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- на передачу разового срочного сообщения;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- подтвержденная туроператором, стоимость проживания в отеле за неиспользованную часть срока пребывания по договору о\r\nреализации туристского продукта/туристских услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Расходы на приобретение проездных документов возмещаются только при условии, что первоначальный билет замене не\r\nподлежал.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>В случаях переоформления проездных документов Страховщик возмещает документально подтвержденные дополнительные\r\nрасходы, связанные с переоформлением проездных документов.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6. Договором страхования может быть установлена безусловная франшиза (часть убытка, которая не подлежит возмещению\r\nСтраховщиком). При безусловной франшизе размер страховой выплаты (суммы, подлежащей к возмещению Страховщиком)\r\nуменьшается на размер франшизы. Размер безусловной франшизы определяется в % от суммы страхового возмещения, причитающейся\r\nк страховой выплате каждому Застрахованному лицу.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>7. Условия освобождения от ответственности.<br>\r\n7.1. При наступлении обстоятельств непреодолимой силы (форс-мажор) Страховщик вправе приостановить выполнение\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>обязательств по Договору страхования на время действия таких обстоятельств.<span>7.2. Под обстоятельствами непреодолимой силы стороны понимают любые обстоятельства на территории действия страхования\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>и/или по маршруту следования на территорию действия страхования по договору страхования/страховому полису, не зависящие от воли\r\nСторон Договора страхования, в том числе: стихийные бедствия (землетрясение, наводнение, ураган), пожар, массовые заболевания\r\n(эпидемии), военные действия и их последствия, террористические акты, диверсии, гражданские волнения, забастовки, мятежи,\r\nвведение чрезвычайного или особого положения, бунты, путчи, государственные перевороты, заговоры, восстания, революции,\r\nвоздействия ядерной энергии, случаи невозможности исполнения Страховщиком обязательств по организации и последующей оплаты\r\nстраховых услуг по причине ограничения перевозок, любых запретительных мер (эпидемиологических, санкционных, финансовых и\r\nиных), установленных органами власти государств, являющихся территорией действия страхования по договору\r\nстрахования/страховому полису и/или по маршруту следования на территорию действия страхования по договору\r\nстрахования/страховому полису, запрет торговых операций, в том числе с отдельными странами вследствие принятия международных\r\nсанкций.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>По всем вопросам, не урегулированным настоящими Условиями страхования и Договором страхования, стороны\r\nДоговора руководствуются Правилами страхования граждан, выезжающих за пределы постоянного места жительства, от\r\n11.06.2020 г.&nbsp;</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div><br></p>','advantages','','',''),(35,NULL,'2022-03-25 15:31:32.311700','2022-07-26 17:29:08.185073',35,1,3,'','Подробнее','<p>\r\n		\r\n	\r\n	\r\n		<div>\r\n			<div>\r\n				<div>\r\n					<p>УСЛОВИЯ СТРАХОВАНИЯ ГРАЖДАН, ВЫЕЗЖАЮЩИХ ЗА ПРЕДЕЛЫ ПОСТОЯННОГО МЕСТА ЖИТЕЛЬСТВА\r\n</p>\r\n					<p>Программа страхования / B\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			\r\n			<div>\r\n				<div>\r\n					<p>Страховой риск\r\n</p>\r\n				</div>\r\n				<div>\r\n					<p>Медицинские и иные расходы / Medical and other expenses\r\n</p>\r\n				</div>\r\n			</div>\r\n			\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>Программа страхования «В» предназначена для страхования граждан, выезжающих за пределы постоянного места\r\nжительства, с туристическими целями или в деловые поездки, с целью занятия активным отдыхом и/или спортом, а также\r\nс целью выполнения своих профессиональных обязанностей.\r\n</p>\r\n						<p>Программой страхования «В» не предусмотрена страховая защита по любым событиям, произошедшим в результате\r\nзанятия Застрахованного лица зимними видами спорта, экстремальными видами спорта, дайвингом в период пребывания на\r\nтерритории страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Определения<br>\r\nАктивный отдых – отдых с повышенным риском травматизма: самодеятельный и спортивный туризм; плавание с трубкой и\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>маской под поверхностью воды (сноркелинг), в том числе подводная охота; подвижные игры спортивного характера на суше и в воде;\r\nпрыжки и игры на батутах, посещение аттракционов, в том числе - водных аттракционов, аквапарков, катание с водных горок, прыжки\r\nв воду с берега или в бассейн; катание или путешествие на лодках (гребных, моторных, парусных), плотах и маломерных судах, катание\r\nна вертолетах и легкомоторных самолетах; поездки (катание) на всех типах самокатов, велосипедов, мопедов, мотороллеров, скутеров,\r\nмотоциклов, квадроциклов, снегоходов, водных мотоциклов, водных лыж, электрических самобалансирующихся устройств (моноколесо,\r\nгироскутер, иные аналогичные устройства); развлечения на воде с использованием буксируемых плавательных средств или парашюта;\r\nпешие восхождения (трэкинг) на высоту до 1 500 метров, организованные экскурсии по пещерам; поездки и путешествия на\r\nавтомашинах внедорожного класса (джип-сафари), спортивных автомобилях; поездки (катание, экскурсии) на лошадях и других\r\nживотных, участие в сафари.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Дайвинг - подводное плавание со специальным снаряжением.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Занятие дайвингом – под занятием дайвингом понимается непосредственное время нахождение в воде в открытом водоеме, 1\r\nчас подготовки к погружению, а также 1 час после подъема из воды, определяемые на основании записи в журнале, регистрирующем\r\nпогружения.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Технический дайвинг включает в себя глубоководные, более 40 метров, погружения с применением кислородно-азотно-гелиевой\r\nсмеси с обязательной декомпрессионной остановкой с использованием аппаратов замкнутого и полузамкнутого типа. К техническому\r\nдайвингу относятся погружения в надголовных средах и подледный дайвинг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Зимние виды спорта: горнолыжный спорт и сноубординг (спуск по зеленым, синим, красным маркированным трассам), лыжные\r\nгонки, лыжное двоеборье, биатлон, прыжки на лыжах с трамплина, санный спорт, бобслей, скелетон, фигурное катание, конькобежный\r\nспорт, шорт-трек, хоккей с шайбой, хоккей с мячом, кёрлинг, буерный спорт, зимнее плавание.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Спорт – любые виды спортивных мероприятий, включая проведение соревнований, тренировок, выступлений (включает\r\nпрофессиональный и любительский спорт), не подпадающие под определения Активного отдыха.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Экстремальные виды спорта / экстремальные виды отдыха - виды спорта / отдыха с высокой степенью опасности для жизни\r\nи здоровья спортсмена, предусматривающие большое количество акробатических трюков, в том числе: автоспорт, аквабайк, альпинизм,\r\nбейсджампинг, бокинг (джоли-джампинг), вейкбординг, вингсьютинг, виндсерфинг (wave riding, трюки на волнах, зимний виндсерфинг),\r\nBicycle Moto extreme (BMX), водный туризм (сплав по рекам (катамаран, байдарка, каноэ), рафтинг, каякинг), горнолыжный спорт (спуск\r\nпо черным маркированным трассам и иным трассам, относящимся к повышенному классу сложности), дельтапланеризм\r\n(мотодельтапланеризм), дронсерфинг, зиплайн, зорбинг, кайтсёрфинг (зимний кайтсёрфинг), кайтфристайл, каньонинг, кейв – дайвинг,\r\nлонгбординг, маунтинбординг, маунтинбайк, ньюскул скиинг, парапланерный спорт, парашютный спорт, паркур и фриран, планерный\r\nспорт, погинг, погружение (катание) на подводных аппаратах (подводные лодки, батискафы, иные аналогичные аппараты), родео,\r\nроллерблейдинг, роуп-джампинг, руфинг, сёрфинг, силовой экстрим, скалолазание, скейтбординг, слоупста́йл (фристайл, сноуборд,\r\nмаунтинбординг), слэклайн, сноубординг (спуск по черным маркированным трассам и иным трассам, относящимся к повышенному\r\nклассу сложности), сноукайтинг, спелеология, спидрайдинг, стантрайдинг, стритлатинг (стритлюж), сэндбординг, триал, управление\r\n(пилотирование) летательным аппаратом любого типа (самолётный спорт, вертолётный спорт), полеты на воздухоплавательных\r\nаппаратах (воздушные шары, дирижабли, иные аналогичные аппараты), урбан эксплорейшн, флайбординг, фрибординг, фрирайд,\r\nфристайл, хавпайп, хелискайтинг, хорсбординг, эндуро и иные виды спорта / отдыха, отнесенные к экстремальным (согласно данным\r\nроссийских и международных реестров видов спорта).\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				\r\n				<div>\r\n					<div>\r\n						<p>Медицинская помощь – комплекс мероприятий, направленных на поддержание и (или) восстановление здоровья и включающих\r\nв себя предоставление медицинских услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медицинские услуги – медицинское вмешательство или комплекс медицинских вмешательств, направленных на профилактику,\r\nдиагностику, лечение заболеваний и медицинскую реабилитацию и имеющих самостоятельное законченное значение.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Формы оказания медицинской помощи:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- экстренная - медицинская помощь, оказываемая при внезапных острых заболеваниях, состояниях, обострении хронических\r\nзаболеваний, представляющих угрозу жизни пациента;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- неотложная - медицинская помощь, оказываемая при внезапных острых заболеваниях, состояниях, обострении хронических\r\nзаболеваний без явных признаков угрозы жизни пациента;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- плановая - медицинская помощь, которая оказывается при проведении профилактических мероприятий, при заболеваниях и\r\nсостояниях, не сопровождающихся угрозой жизни пациента, не требующих экстренной и неотложной медицинской помощи, и отсрочка\r\nоказания которой на определенное время не повлечет за собой ухудшение состояния пациента, угрозу его жизни и здоровью.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Скорая медицинская помощь, в том числе скорая специализированная - вид медицинской помощи, оказывается при\r\nзаболеваниях, несчастных случаях, травмах, отравлениях и других состояниях, требующих срочного медицинского вмешательства.\r\nСкорая, в том числе скорая специализированная, медицинская помощь оказывается в экстренной или неотложной форме вне\r\nмедицинской организации, а также в амбулаторных и стационарных условиях.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Условия оказания медицинской помощи:<br>\r\n- вне медицинской организации;<br>\r\n- амбулаторно (в условиях, не предусматривающих круглосуточного медицинского наблюдения и лечения), в том числе на дому\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>при вызове медицинского работника;<span>- в дневном стационаре (в условиях, предусматривающих медицинское наблюдение и лечение в дневное время, но не\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>требующих круглосуточного медицинского наблюдения и лечения);<span>- стационарно (в условиях, обеспечивающих круглосуточное медицинское наблюдение и лечение).<span>Острое заболевание/состояние – внезапное нарушение функции или строения органов и тканей, возникающее под влиянием\r\n</span></span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>внешних или внутренних факторов, требующее безотлагательного вмешательства медицинского специалиста и проведения лечения в\r\nближайшие часы после возникновения первых симптомов.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Хроническое заболевание – длительно существующее стойкое отклонение от нормы и требующее постоянного (регулярного)\r\nнаблюдения и/или лечения и обладающее одним из следующих условий:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p style=\"text-align: right;\">- вызваны необратимыми изменениями в организме;<br>\r\n- существует неопределенный период времени;<br>\r\n- имеет высокую вероятность возникновение обострений, рецидивов;<br>\r\n- требует комплексного реабилитационно-восстановительного лечения, включающего поддерживающее медикаментозное</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>лечение и специальных самостоятельных навыков, чтобы справляться с заболеванием;<br>\r\n- требует долгосрочного наблюдения врачом-специалистом, регулярных осмотров врачом и клинико-диагностических\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>исследования.<span>Обострение хронического заболевания – хроническое заболевание (о наличие которого Застрахованному лицу было известно\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>на момент заключения договора о реализации туристского продукта/туристских услуг), по поводу которого Застрахованное лицо\r\nполучало или не получало лечение в прошлом, остро проявившееся на фоне ремиссии и/или стандартного курсового лечения,\r\nпотребовавшее получения медицинской специализированной помощи.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Экстренная госпитализация –<br>\r\nспециализированной медицинской помощи<br>\r\nхронических болезней, иных острых заболевания/состояний), в том числе травм, отравлений, ожогов, угрожающих жизни и требующих\r\nинтенсивной терапии и круглосуточного медицинского наблюдения.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>госпитализация в стационар направленная на оказание экстренной\r\nв случаях: острой хирургической патологии или острых заболеваний (обострения\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Плановая госпитализация – заранее согласованная госпитализация в круглосуточный стационар, допускающая возможную\r\nочередность и осуществляющаяся по направлению лечащего врача для прохождения комплексного обследования, лечения, включая\r\nхирургическое, при состояниях, не представляющих непосредственную угрозу для жизни человека, отсрочка в выполнении которых не\r\nвлечет за собой возникновения необратимых последствий и осложнений для организма человека.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1. Страховые случаи.<span>В соответствии с настоящими Условиями страхования граждан по Программе страхования «В» (далее – Условия страхования)\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>согласно Правилам страхования граждан, выезжающих за пределы постоянного места жительства, от 11.06.2020 г. (далее – Правила\r\nстрахования) договор страхования заключен на случай реализации следующих рисков:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1. Возникновение у Застрахованного лица расходов, понесенных им в период нахождения на территории\r\nстрахования:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1. Медицинских расходов при травме, отравлении, внезапном остром заболевании или обострении хронического\r\nзаболевания, повлекшего угрозу для жизни Застрахованного лица, в лимите страховой суммы, установленной договором\r\nстрахования:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.1. на амбулаторную помощь, включая расходы на врачебную помощь, лабораторно-инструментальные исследования,\r\nлечебно-диагностические мероприятия; расходы на оплату назначенных врачом медикаментов, перевязочных средств, средств\r\nфиксации любого типа, вспомогательных средств реабилитации (костыли);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.2. на стационарную помощь, включая расходы на врачебную помощь, расходы на проведение лечебных мероприятий и\r\nопераций, лабораторно-инструментальных исследований, круглосуточное пребывание в палате стандартного типа, питание,\r\nмедикаментозное обеспечение и патронажные услуги (уход); расходы на оплату назначенных врачом медикаментов, перевязочных\r\nсредств, средств фиксации любого типа, вспомогательных средств реабилитации (костыли);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.1.3. на экстренную стоматологическую помощь в связи с острой зубной болью в лимите страховой суммы, указанном в пункте\r\n6.6.1.2 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.2. Медико-транспортных расходов при травме, отравлении, внезапном остром заболевании или обострении\r\nхронического заболевания, повлекшего угрозу для жизни Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.2.1. на медицинскую эвакуацию (транспортировку) с места нахождения Застрахованного лица на территории страхования в\r\nближайшее медицинское учреждение (клиника, госпиталь, аккредитованный частнопрактикующий врач), где необходимая медицинская\r\nпомощь может быть оказана. При этом, эвакуация (транспортировка) осуществляется соответствующим медицинскому состоянию\r\nЗастрахованного лица транспортным средством, предназначенным для скорой медицинской помощи / такси;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.2.2. на транспортировку Застрахованного лица из одной клиники в другую в случае медицинской необходимости оказания\r\nспециализированных видов медицинской помощи;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.2.3. на медицинскую репатриацию Застрахованного лица с территории страхования транспортным средством, включая\r\nрасходы на медицинское сопровождение (если такое сопровождение предписано лечащим врачом), до ближайшего к месту постоянного\r\nпроживания Застрахованного лица (населенному пункту на территории РФ или в стране гражданства) международного транспортного\r\nузла (аэропорта, железнодорожного вокзала), с которым имеется прямое сообщение, при этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки за границами РФ: до международного транспортного узла (аэропорта, железнодорожного\r\nвокзала), с которым имеется прямое сообщение. При отсутствии прямого сообщения между территорией страхования и местом\r\nпостоянного проживания на территории РФ или в стране гражданства, включая стыковочные рейсы между транспортными узлами на\r\nтерриториях иных государств;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на\r\nтерритории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.2.4. на медицинскую репатриацию Застрахованного лица с территории страхования, в случае, если расходы по пребыванию\r\nв стационаре могут превысить установленную в договоре страхования страховую сумму, или в случаях, когда лечение за границей\r\nстраны постоянного проживания значительно превышает расходы на медицинскую репатриацию, при этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки за границами РФ: до международного транспортного узла (аэропорта, железнодорожного\r\nвокзала), с которым имеется прямое сообщение. При отсутствии прямого сообщения между территорией страхования и местом\r\nпостоянного проживания на территории РФ или в стране гражданства, включая стыковочные рейсы между транспортными узлами на\r\nтерриториях иных государств;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на\r\nтерритории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медицинская репатриация осуществляется исключительно в случаях, когда ее необходимость (целесообразность) и возможность\r\nподтверждается заключением врача Сервисной компании на основании документов от лечащего врача медицинского учреждения\r\nстационарного типа страны (государства), расположенного на территории страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Решение о возможности, целесообразности медицинской репатриации и средствах (условиях) ее осуществления, принимает\r\nлечащий врач стационарного медицинского учреждения путем оформления соответствующих документов (разрешение на вылет).\r\nВозможность осуществления медицинской репатриации Застрахованного лица и её порядок (способы транспортировки и маршруты\r\nперемещения) определяются Сервисной компанией по согласованию со Страховщиком, при этом Страховщик не возмещает расходы,\r\nвызванные несоблюдением перевозчиком транспортного расписания, а также иных расходов, предварительно не согласованных\r\nСтраховщиком.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>В случаях, когда Застрахованное лицо (его законный представитель) отказывается от медицинской репатриации, организованной\r\nи согласованной к оплате Страховщиком, то с момента отказа от медицинской репатриации Страховщик освобождается от обязанности\r\nпо организации и оплате дальнейших медицинских, медико-транспортных и иных расходов Застрахованного лица по данному\r\nстраховому случаю, включая расходы, связанные с последующим его возвращением на постоянное место жительства.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.3. Расходов на посмертную репатриацию вследствие травмы, отравления, внезапного острого заболевания или\r\nобострения хронического заболевания:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.3.1. расходы на посмертную репатриацию тела Застрахованного лица, включающие в себя расходы на оплату процедуры\r\nстандартной подготовки к захоронению или процедуры стандартной подготовки к кремации (по желанию родственников\r\nЗастрахованного лица и по согласованию со Страховщиком – включая проведение стандартной процедуры кремации на территории\r\nстрахования) и стандартного комплекта похоронных принадлежностей по стандартной (базовой) стоимости для территории\r\nстрахования, при этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки за границами РФ: до международного транспортного узла на территории РФ (аэропорта,\r\nжелезнодорожного вокзала), с которым имеется прямое сообщение. При отсутствии прямого сообщения между территорией страхования\r\nи местом постоянного проживания на территории РФ или в стране гражданства, включая стыковочные рейсы между транспортными</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>узлами на территориях иных государств;<br>\r\n- в случаях совершения поездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>территории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала).<br>\r\nРепатриация тела Застрахованного лица осуществляется в соответствии с принятыми международными стандартами.\r\nСтраховщик не оплачивает расходы на ритуальные услуги сверх стандартной процедуры подготовки к захоронению/кремации и\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>стандартного комплекта похоронных принадлежностей на территории страхования, а также по оплате любых расходов по процедуре\r\nзахоронения/кремации и оплате стоимости места для захоронения на территории РФ или страны гражданства;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.3.2. расходы на проезд по сопровождению тела Застрахованного лица для одного из близких родственников из числа\r\nсовершавших с ним совместную поездку, при условии, что сопровождающий тело близкий родственник не может воспользоваться\r\nсвоими проездными документами для возвращения из совместной поездки, при этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки за границами РФ: до международного транспортного узла на территории РФ (аэропорта,\r\nжелезнодорожного вокзала), с которым имеется прямое сообщение. При отсутствии прямого сообщения между территорией страхования\r\nи местом постоянного проживания на территории РФ или в стране гражданства, включая стыковочные рейсы между транспортными\r\nузлами на территориях иных государств;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на\r\nтерритории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4. Транспортных расходов при травме, отравлении, внезапном остром заболевании или обострении хронического\r\nзаболевания, повлекшего угрозу для жизни Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4.1. В случае если отъезд Застрахованного лица, находящегося на стационарном лечении или на карантине, невозможен\r\nвовремя, т.е. в день, указанный в проездных документах, находящихся на руках у Застрахованного лица, а также в случае выписки из\r\nстационара в день вылета, оплачиваются расходы:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4.1.1. на проезд до аэропорта, железнодорожного вокзала на территории страхования;<br>\r\n1.1.4.1.2. на проезд в один конец к месту постоянного проживания (страны гражданства) эконом классом, при этом:<br>\r\n- в случаях совершения поездки за границами РФ: до международного транспортного узла (аэропорта, железнодорожного\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>вокзала), с которым имеется прямое сообщение. При отсутствии прямого сообщения между территорией страхования и местом\r\nпостоянного проживания на территории РФ или в стране гражданства, включая стыковочные рейсы между транспортными узлами на\r\nтерриториях иных государств;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в случаях совершения поездки по территории РФ: до ближайшего к месту постоянного проживания (населенному пункту на\r\nтерритории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта, железнодорожного вокзала).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом Застрахованное лицо обязано вернуть (сдать) неиспользованные проездные документы Страховщику (представителю\r\nСтраховщика). При несоблюдении данного условия Страховщик вправе вычесть из суммы страхового возмещения стоимость\r\nнеиспользованных проездных документов.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Кроме того, Страховщиком оплачиваются транспортные расходы в отношении одного близкого родственника\r\nнесовершеннолетнего Застрахованного лица, находящегося с ним в одной поездке, перечисленные в пунктах 1.1.4.1.1 - 1.1.4.1.2\r\nнастоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4.2. на оплату проезда эконом классом на территорию страхования и до ближайшего к месту постоянного проживания\r\nЗастрахованного лица (населенному пункту на территории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта,\r\nжелезнодорожного вокзала) одному совершеннолетнему близкому родственнику совершеннолетнего Застрахованного лица в случае\r\nобоснованной медицинской необходимости визита родственника, если срок госпитализации Застрахованного лица превысил 15 дней;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4.3. на оплату проезда эконом классом на территорию страхования и до ближайшего к месту постоянного проживания\r\nЗастрахованного лица (населенному пункту на территории РФ или в стране гражданства) внутреннего транспортного узла (аэропорта,\r\nжелезнодорожного вокзала) одному из родителей (официальному представителю) несовершеннолетнего Застрахованного лица в\r\nслучае оставления несовершеннолетнего Застрахованного лица без присмотра (по любым причинам) совершеннолетним лицом,\r\nсопровождавшим его в поездке.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Способы транспортировки, маршруты перемещения лиц, указанных в пунктах 1.1.4.1 - 1.1.4.3 настоящих Условий страхования\r\nопределяются Сервисной компанией по согласованию со Страховщиком, при этом Страховщик не возмещает расходы, вызванные\r\nнесоблюдением перевозчиком транспортного расписания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.4.4. на оплату перевозки (трансфера) и услуг по подносу багажа (личных вещей) Застрахованного лица на территории\r\nстрахования в случаях отсутствия физических возможностей у Застрахованного лица для самостоятельной перевозки багажа (личных\r\nвещей), напрямую связанных со страховым случаем.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5. Расходов на проживание при травме, отравлении, внезапном остром заболевании или обострении хронического\r\nзаболевания, повлекшего угрозу для жизни Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5.1. связанных с проживанием (без питания) Застрахованного лица в стандартном номере отеля на территории страхования\r\nпосле окончания стационарного лечения, вызванного наступлением страхового случая, сроком до даты медицинской репатриации\r\nЗастрахованного лица к месту постоянного проживания (населенному пункту на территории РФ или в стране гражданства), но не более\r\n5 дней, начиная с даты, следующей за датой выписки из стационара;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5.2. связанных с проживанием (без питания) одного совершеннолетнего близкого родственника (но не более 5 дней),\r\nсопровождающего несовершеннолетнее Застрахованное лицо в одной поездке, в стандартном номере отеля на территории страхования\r\nсроком до даты медицинской репатриации несовершеннолетнего Застрахованного лица к месту постоянного проживания (населенному\r\nпункту на территории РФ или в стране гражданства), если несовершеннолетнее Застрахованное лицо было госпитализировано во время\r\nдействия договора страхования и его госпитализация продолжается после даты запланированного возвращения из поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5.3. связанных с проживанием (без питания) Застрахованного лица в стандартном номере отеля на территории страхования\r\nв связи с карантином на весь срок карантина, но в лимите ответственности Страховщика, определенном договором страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5.4. связанных с проживанием (без питания) одного совершеннолетнего близкого родственника, сопровождающего\r\nнесовершеннолетнее Застрахованное лицо в одной поездке, в стандартном номере отеля на территории страхования в связи с\r\nкарантином на весь срок карантина несовершеннолетнего Застрахованного лица;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.5.5. предварительно согласованные Страховщиком расходы на проживание (с питанием) в стандартном номере отеля на\r\nтерритории страхования несовершеннолетнего Застрахованного лица, оставшегося без присмотра сопровождавшего его в одной\r\nпоездке совершеннолетнего лица, но сроком не более 5 дней;<br>\r\n1.1.5.6. предварительно согласованные Страховщиком расходы, связанные с проживанием (без питания) в стандартном номере отеля\r\nна территории страхования одного совершеннолетнего близкого родственника совершеннолетнего Застрахованного лица на срок\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>не более 5 дней в случае госпитализации Застрахованного лица сроком более 15 дней и при наличии медицинской необходимости\r\nв визите родственника.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.6. Дополнительных расходов Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.1.6.1. на телефонные переговоры с Сервисной компанией и / или Страховщиком по каждому страховому событию в лимите,\r\nуказанном в пункте 6.6.6.1 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>1.2. Если на дату окончания действия ответственности Страховщика по договору страхования возвращение Застрахованного\r\nлица на постоянное место жительства невозможно в связи с его нахождением на стационарном лечении, Страховщик выполняет свои\r\nобязательства по договору страхования по организации и оплате медицинских расходов (пункты 1.1.1.1, 1.1.1.2 настоящих Условий\r\nстрахования), медико-транспортных расходов (пункты 1.1.2.3, 1.1.2.4 настоящих Условий страхования) и расходов по репатриации\r\n(пункт 1.1.3.1 настоящих Условий страхования) в пределах страховой суммы, установленной договором страхования, но не более 15\r\nкалендарных дней, следующих за днем окончания срока действия договора страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2. Территория страхования.</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>2.1. Территорией страхования являются страны (географические зоны, регионы), указанные в договоре страхования, за\r\nисключением территорий стран и/или географических зон, перечисленных в пунктах 2.3, 2.4 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.2. Исключаются из территории страхования:<br>\r\n2.2.1. государства, на территории которых ведутся военные действия;<br>\r\n2.2.2.государства, на территории которых обнаружены и действуют очаги эпидемий;<br>\r\n2.2.3. государства, при посещении которых с очевидной вероятностью может быть нанесен вред здоровью и жизни людей;\r\n2.2.4. государства, признанные Правительством РФ или другими органами государственной власти нежелательными для\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>посещения гражданами РФ;<br>\r\n2.2.5. территории, на которых происходят явления стихийного характера (наводнение, землетрясение, извержение вулкана,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>дожди интенсивностью 30 мм в час и более, оползни, заносы, пожары, события, призванные в установленном порядке чрезвычайными),\r\nа также загрязнение окружающей среды, эпидемии, введен карантин.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3. Территорией страхования не является:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3.1. территория любой иной страны, указанной в договоре (полисе) страхования как территория страхования, кроме страны, на\r\nтерритории которой у Застрахованного лица произошло страховое событие, повлекшее расходы в соответствии с пунктом 1.1 настоящих\r\nУсловий страхования (для договоров (полисов) страхования, в которых в разделе/ графе «Территория страхования» указано более одной\r\nстраны / Шенген / Весь мир);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3.2. территория в границах 100-км зоны от административной границы населенного пункта постоянного места жительства на\r\nтерритории РФ – при путешествии по территории РФ;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.3.3. территория РФ при совершении поездки за границы РФ, когда населенные пункты на территории РФ являются транзитными\r\nдля доезда до пограничного пункта на территории РФ, откуда осуществляется выезд за границы РФ.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>2.4. Территорией страхования не является:<br>\r\n2.4.1. для гражданина РФ:<br>\r\n- 100-километровая зона от административной границы населенного пункта постоянного места жительства на территории РФ –\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>при путешествии по территории РФ;<br>\r\n- страна двойного гражданства;<br>\r\n- страна, в которой Застрахованное лицо имеет вид на жительство или иной статус, позволяющий безвыездно пребывать на\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>территории данной страны, не нарушая визовый режим;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>РФ:\r\n</p>\r\n					</div>\r\n					<div>\r\n						<p>2.4.2. для иностранного гражданина или лица без гражданства, постоянно или преимущественно проживающего на территории\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- 100-километровая зона от административной границы населенного пункта на территории РФ,<br>\r\n- страна гражданства;<br>\r\n- страна, в которой Застрахованное лицо имеет вид на жительство или иной статус, позволяющий безвыездно пребывать на\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>территории данной страны, не нарушая визовый режим.<br>\r\n2.4.3. страна, в которую выезжает Застрахованное лицо с целью получения вида на жительство/гражданства.<br>\r\n2.5. Граждане РФ, выезжающие за пределы места постоянного проживания, имеющие вид на жительство и/или двойное\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>гражданство в стране предполагаемого пребывания или выезжающие с целью получения постоянного места жительства, не могут быть\r\nзастрахованы на настоящих Условиях страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3. Основания для отказа в страховой выплате. Расходы, не возмещаемые Страховщиком.<br>\r\n3.1. Не являются страховыми случаями и не оплачиваются Страховщиком расходы Застрахованного лица по событиям,\r\nперечисленным в пункте 1.1 настоящих Условий страхования, понесенные им в период нахождения на территории\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>страхования, в результате:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.1. участия Застрахованного лица в волнениях, восстаниях, бунтах, войнах, общественных беспорядках, противоправных\r\nдействиях на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.2. службы Застрахованного лица в вооруженных силах или вооруженных формированиях на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.3. нахождения Застрахованного лица в состоянии алкогольного, наркотического или иного токсического опьянения, а также\r\nв период нахождения под воздействием иных психоактивных веществ и/или в случае отказа Застрахованного лица пройти\r\nосвидетельствование на предмет выявления состояния алкогольного, наркотического, токсического опьянения при наступлении\r\nсобытия, имеющего признаки страхового;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.4. занятия Застрахованного лица любым видом спорта на профессиональном и/или любительском уровне, включая участие в\r\nспортивных соревнованиях (код вида деятельности «SR»), за исключением случаев, когда Страховщик был поставлен в известность при\r\nзаключении договора страхования о цели поездки Застрахованного лица и в отношении этих обстоятельств была проведена процедура\r\nоценки риска, был применен соответствующий повышающий коэффициент, занятие любым видом спорта на профессиональном и/или\r\nлюбительском уровне, включая участие в спортивных соревнованиях, предусмотрено договором страхования: код вида деятельности\r\n«SR» указан в Полисе Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом программой страхования «В», в том числе с кодом вида деятельности «SR», не покрываются расходы Застрахованного\r\nлица, перечисленные в пункте 1.1 настоящих Условий страхования, наступившие в результате занятий Застрахованного лица зимними\r\nвидами спорта, дайвингом и экстремальными видами спорта, указанными в разделе «Определения» настоящих Условий страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.5. занятия Застрахованного лица активным отдыхом (код вида деятельности «AL»), за исключением случаев, когда\r\nСтраховщик был поставлен в известность при заключении договора страхования о цели поездки Застрахованного лица и в отношении\r\nэтих обстоятельств была проведена процедура оценки риска, был применен соответствующий повышающий коэффициент, занятие\r\nактивным отдыхом предусмотрено договором страхования: код вида деятельности «AL» указан в Полисе Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Перечень видов активного отдыха, принимаемых на страхование, приведен в разделе «Определения» настоящих Условий\r\nстрахования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.6. лучевого поражения или иного расстройства здоровья Застрахованного лица, полученных в результате прямого или\r\nкосвенного воздействия радиоактивного облучения;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.7. обострения хронического заболевания или его осложнений, существовавших на момент заключения договора страхования\r\nи требовавших лечения до начала срока действия договора страхования (включая последствия несчастных случаев, произошедших до\r\nвыезда Застрахованного лица за пределы постоянного места жительства), даже если Застрахованное лицо ранее не подвергалось\r\nлечению, а также при заболеваниях и их осложнениях, по поводу которых Застрахованное лицо лечилось в течение последних шести\r\nмесяцев до заключения договора страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При обострении хронического заболевания, повлекшего угрозу для жизни Застрахованного лица, лимит ответственности\r\nСтраховщика на оказание экстренной стационарной медицинской помощи по жизненным показаниям составляет 10% от страховой\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>суммы.В случае невозможности выделить из общего счета стоимость экстренной стационарной помощи, оказанной по поводу\r\nобострения хронического заболевания, повлекшего угрозу для жизни Застрахованного лица, ее стоимость принимается равной 1\r\n(одному) койко-дню, при оказании экстренной хирургической помощи – 2 койко-дням: операционные и послеоперационные сутки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.8. преднамеренного, том числе – планового, лечения за рубежом. При этом Страховщик не возмещает расходы на лечение,\r\nкоторое послужило целью поездки, а также расходы, вызванные ухудшением состояния здоровья и/или смертью Застрахованного лица\r\nв связи с этим лечением, и связанные с этим событием медико-транспортные расходы;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.9. не оплачиваются Страховщиком расходы Застрахованного лица на медицинские и медико-транспортные по поводу\r\nбеременности и/или родовспоможению, в том числе с необходимостью осуществления плановых медицинских мероприятий по ведению\r\nбеременности (медицинские осмотры, исследования, процедуры и манипуляции и прочие услуги, связанные с диагностикой и ведением\r\nбеременности и ее осложнений, в том числе - при угрозе прерывания беременности, услуги по прерыванию беременности без</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>медицинских показаний, связанных с угрозой жизни Застрахованного лица) и родовспоможению (лечебно-диагностические услуги по\r\nродовспоможению и/или по послеродовым состояниям и/или заболеваниям и их осложнениям, послеродовому уходу за новорожденным).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом возмещаются медицинские и медико-транспортные расходы в случае угрозы жизни Застрахованного лица в результате\r\nвнезапных осложнений протекания беременности в результате несчастного случая, включая расходы на прерывание беременности,\r\nсвязанное с последствием несчастного случая, или с внематочной беременностью.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>В любом случае Страховщик не возмещает расходы, возникшие в связи с наблюдением, лечением, транспортировкой, эвакуацией\r\nи репатриацией новорожденного ребенка Застрахованного лица;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.10. проявлений нервных и психических заболеваний (в том числе: демиелинизирующих заболеваний, депрессии, эпилепсии),\r\nврожденных аномалий, генетических заболеваний, а также связанных с ними травматических повреждений и их осложнений;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.11. любых (в том числе косвенных) последствий алкогольного опьянения, в том числе - травмы и их последствия, употребления\r\nнаркотических или токсических веществ, в том числе любых травм и заболеваний Застрахованного лица (включая летальный исход в\r\nсостоянии алкогольного или наркотического опьянения), наступивших при употреблении алкогольных, наркотических или токсических\r\nвеществ.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом факт употребления алкогольных, наркотических, токсических веществ может быть зафиксирован в медицинских\r\nзаключениях/рапортах, полицейских протоколах, в показаниях свидетелей и иных документах, относящихся к произошедшему событию;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.12. заболеваний, преимущественно передающихся половым путем, классических венерических заболеваний, ВИЧ-инфекции\r\nи ее осложнений, а также травм, полученных в результате половых контактов;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.13. попытки самоубийства и / или последствий попытки самоубийства, умышленного членовредительства или других\r\nумышленных действий Застрахованного лица (иного лица, в отношении которого действуют обязанности Страховщика по исполнению\r\nдоговора страхования), направленных на причинение вреда своей жизни, здоровью;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.14. лечения нетрадиционными методами, официально не признанными наукой и медициной (народная медицина,\r\nрефлексология, гомеопатия, хиропрактика, восточная медицина и другие методы, не относящиеся к традиционной медицине);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.15. диагностики и лечения онкологических заболеваний, а также их осложнений, с момента установления диагноза\r\nонкологического заболевания; до момента установления диагноза могут быть возмещены медицинские расходы на оказание первой\r\nнеотложноймедицинскойпомощи,включаядиагностику. ПриэтомнепризнаютсястраховымиинеоплачиваютсяСтраховщикомслучаи,\r\nкогда онкологический диагноз был установлен Застрахованному лицу до даты выезда в поездку вне зависимости от того, проводилось\r\nпо нему ранее лечение или нет;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.16. туберкулеза, саркоидоза, муковисцидоза, независимо от клинической формы и стадии процесса;<br>\r\n3.1.17. выявления заболеваний крови, гепатитов В и С;<br>\r\n3.1.18. грибковых заболеваний, включая глубокие микозы, онихомикозы;<br>\r\n3.1.19. особо опасных и тропических инфекций (таких как, натуральная оспа, чума, сибирская язва, холера, сыпной тиф,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>геморрагические лихорадки (исключая лихорадку Денге и геморрагическую лихорадку с почечным синдромом (ГЛПС)) и заболеваний,\r\nкоторые могли быть предотвращены заблаговременной вакцинацией и/или являющихся следствием нарушения Застрахованным лицом\r\nобязательных профилактических (карантинных) мероприятий, обязательных к проведению до запланированной поездки на территорию\r\nстрахования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.20. иных инфекционных или паразитарных заболеваний, не требующих организации и проведения карантинных мероприятий.\r\nВ случае угрозы жизни, а также до момента установления диагноза могут быть покрыты медицинские расходы на оказание первой\r\nнеотложной медицинской помощи, включая диагностику;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.21. заболеваний тканей пародонта, ортопедических, ортодонтических нарушений, требующих протезирования, манипуляций\r\nна зубах, покрытых ортопедическими и ортодонтическими конструкциями (за исключением необходимости оказания экстренной\r\nмедицинской помощи с целью купирования острого болевого синдрома при остром воспалении или травме);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.22. последствий полиомиелита, энцефалита, менингита, полиневрита;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.23. последствий заболеваний, наступивших в результате трудовой деятельности, включая выполнения любых форм опасной\r\nработы (то есть когда можно обоснованно предполагать, что в результате выполнения данной работы может быть причинен вред\r\nздоровью) или связанных с любым ремеслом или профессией, а также профессиональных заболеваний (код вида деятельности «JW»), за\r\nисключением случаев, когда Страховщик был поставлен в известность при заключении договора страхования о цели поездки\r\nЗастрахованного лица и в отношении этих обстоятельств была проведена процедура оценки риска, был применен соответствующий\r\nповышающий коэффициент, трудовая деятельность, включая выполнение любых форм опасной работы, предусмотрена договором\r\nстрахования: код вида деятельности «JW» указан в Полисе Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.24. солнечных ожогов, фотодерматитов;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.25. последствий несчастных случаев, произошедших в результате управления транспортным средством Застрахованным\r\nлицом в состоянии алкогольного, наркотического или токсического опьянения, а также при передаче Застрахованным лицом управления\r\nтранспортным средством лицу, находящемуся в состоянии алкогольного, наркотического или токсического опьянения и/или не\r\nимеющему соответствующего права управления транспортным средством;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.26. действий Застрахованного лица, повышающих вероятность наступления страхового события и/или создание ситуаций,\r\nпри которых Застрахованное лицо подвергало себя неоправданному риску, в том числе несоблюдение Застрахованным лицом\r\nпредупредительных мер безопасности, инструкций и предписаний, действующих на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.27. любые расходы, возникшие в период пребывания Застрахованного лица на территории страхования (при выезде за\r\nпределы РФ), если поездка Застрахованного лица на территорию страхования состоялась ранее заключения договора страхования в\r\nотношении данного Застрахованного лица на эту поездку, либо поездка Застрахованного лица на территорию страхования имела место\r\nбез пересечения границы РФ (в соответствии с пунктами 7.6, 7.10 Правил страхования).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.28. занятия Застрахованного лица зимними видами спорта, дайвингом и экстремальными видами спорта, перечисленными в\r\nразделе «Определения» настоящих Условий страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.29. возникновения расходов Застрахованного лица на территории страхования, связанных с проведением ему обязательных\r\nтестирований по выявлению коронавирусной инфекции COVID-19 (за исключением случаев проведения тестирования при ухудшении\r\nсостояния здоровья с симптомами COVID-19), а также расходов по проживанию и питанию Застрахованного лица на все время\r\nпребывания в карантине на территории страхования по поводу COVID-19 в отсутствие лабораторно подтвержденного диагноза и\r\nрасходов по возвращению Застрахованного лица к месту постоянного проживания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.1.30. возникновения любых расходов Застрахованного лица на территории страхования по поводу коронавирусной инфекции\r\nCOVID-19, при условии, что на дату начала поездки Застрахованного лица:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- в страну поездки въезд не разрешен (в том числе с целью туризма) и/или со страной прекращено авиасообщение ввиду\r\nраспространения коронавирусной инфекции COVID-19 на территории страны/стран поездки;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- страна временного пребывания находилась в списке стран, запрещенных / ограниченных к посещению гражданами РФ.<br>\r\n3.1.31. не оплачиваются расходы Застрахованного лица по возвращению к постоянному месту жительства в результате\r\nнесоблюдения Застрахованным лицом санитарных требований по въезду на территорию страхования (отсутствие справки с\r\nотрицательным тестом на COVID-19/ справка просрочена / отсутствие сертификата о вакцинации / отсутствие регистрации на\r\nгоспорталах стран / отсутствие иных документов, являющихся обязательными для въезда страну временного пребывания, в том числе\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>разрешение на въезд в страну временного пребывания).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2. Не являются страховыми случаями и не оплачиваются Страховщиком расходы, возникшие в результате:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.1. проведения лечения, начатого до и продолжающегося во время действия договора страхования, а также в случае\r\nсуществования медицинских противопоказаний для совершения данной поездки, в результате которой могло наступить обострение\r\nимеющегося хронического заболевания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.2. выполнения врачебных осмотров и лабораторно-инструментальных диагностических исследований без последующего\r\nлечения;</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.3. самостоятельно и без предварительного согласования Сервисной компанией (Страховщиком) организованной\r\nЗастрахованным лицом (его представителем) медицинской транспортировки в лечебное учреждение (перевод из одного лечебного\r\nучреждения в другое на территории страхования) и/или медицинской репатриации в страну постоянного проживания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.4. самостоятельно и без предварительного согласования Сервисной компанией (Страховщиком) организованной\r\nЗастрахованным лицом (его представителем) медицинской репатриации Застрахованного лица в страну постоянного проживания при\r\nзаболеваниях или травмах, которые не требуют услуг патронажа и не препятствуют дальнейшему пребыванию на территории\r\nстрахования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.5. отказа (устного или письменного) Застрахованного лица (его представителя) от медицинской репатриации в страну\r\nпостоянного проживания в случаях, когда репатриация необходима (целесообразна) и возможность её проведения подтверждена\r\nзаключением врача Сервисной компании на основании документов от лечащего врача медицинского учреждения стационарного типа\r\nстраны (государства), расположенного на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.6. обострения хронического заболевания в период пребывания Застрахованного лица в профильном по соответствующему\r\nхроническому заболеванию реабилитационно- восстановительном (санаторно-курортном) медицинском учреждении;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.7. получения Застрахованным лицом медицинских профилактических /диспансерных осмотров, скрининга заболеваний и/или\r\nвыявление факторов риска, любых видов (профиля) диагностических чекапов (check-up); получения лечебно-диагностической\r\nмедицинской помощи в плановом порядке в период пребывания на территории страхования, включая расходы по оказанию экстренной\r\nи неотложной медицинской помощи и иных услуг в случае внезапного расстройства здоровья (обострения хронического заболевания,\r\nтравм) Застрахованного лица, возникшие при получении данного вида услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом Страховщик не возмещает расходы на плановое лечение, которое являлось целью поездки, а также расходы, вызванные\r\nухудшением состояния здоровья и/или смертью Застрахованного лица в связи с этим лечением, и связанные с этим медико-транспортные\r\nрасходы и расходы на репатриацию;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.8. протезирования, включая зубное, глазное, ортопедическое протезирование, слухопротезирование, трансплантации\r\n(имплантации, аутотрансплантации) органов и тканей, включая стоимость расходных материалов;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.9. лечения сопутствующих заболеваний (состояний) при получении скорой и неотложной медицинской помощи по поводу\r\nвнезапно развившегося заболевания (состояния) и/или травмы в результате несчастного случая;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.10. получения медицинских и иных услуг, способствующих зачатию или предотвращающих его, включая медикаментозные\r\nметоды, процедуры и манипуляции по искусственному оплодотворению, медикаментозной и хирургической контрацепции\r\n(стерилизации);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.11. проведения восстановительного (оздоровительного, санаторно-курортного) лечения, в том числе с применением\r\nприродных факторов (бальнеотерапия, гидроколонотерапия, грязелечение), мануальной терапии и остеопрактики, массажа всех типов\r\n(ручной, аппаратный, смешанный), лечебной физкультуры, кинезиотерапии, использования тренажеров и аппаратно-программных\r\nкомплексов, спа-терапии; физиотерапевтического лечения, включая расходы по оказанию экстренной и неотложной медицинской\r\nпомощи и иных услуг в случае внезапного расстройства здоровья (обострения хронического заболевания, травм) Застрахованного лица,\r\nвозникшие при получении данного вида услуг;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.12. проведения пластической, реконструктивной и эстетической (косметической) хирургии;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.13. улучшения условий пребывания в стационаре сверх стандартных, а также получения услуг парикмахера, массажиста,\r\nкосметолога, переводчика, курьера;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.14. проведения плановых профилактических и/или оздоровительных мероприятий, включая – вакцинопрофилактику\r\n(плановую/курсовую);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.15. проведения самолечения, в том числе по рекомендациям третьих лиц, вне зависимости от наличия или отсутствия у\r\nЗастрахованного лица и третьих лиц медицинского образования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.16. закупки и/или ремонта медицинского оборудования (приборов), в том числе - электрокардиостимуляторов,\r\nкардиовертеров-дефибрилляторов, медицинских изделий по коррекции зрения и слуха (очки, слуховые аппараты), аппаратов для\r\nизмерения артериального давления, термометров, глюкометров, инвалидных колясок для последующего использования в\r\nлечении/реабилитации Застрахованного лица.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Исключение составляют расходы по возмездному предоставлению во временное пользование Застрахованному лицу на\r\nтерритории страхования предметов медицинского оборудования по назначению врача, если такая необходимость возникла в результате\r\nсобытия, имеющего признаки страхового;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.17. отказа Застрахованного лица от выполнения предписаний лечащего врача и/или указаний оператора Сервисной компании;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.18. получения Застрахованным лицом медицинской и иной помощи (включая медико-транспортные расходы) в учреждении,\r\nне имеющим соответствующей медицинской лицензии, или у лица, не имеющего права на осуществление медицинской деятельности,\r\nвключая все расходы по возникшим в результате этого последствиям для жизни и здоровья Застрахованного лица, связанным с таким\r\nлечением или оказанием иной помощи;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.19. сообщения Застрахованным лицом Сервисной компании (Страховщику) заведомо ложных сведений об обстоятельствах\r\nсобытия, имеющего признаки страхового, изменения первоначального изложения обстоятельств происшествия, а также фактической\r\nстоимости оказанных ему медицинских услуг, предоставления документов с заведомо ложной информацией, касающейся\r\nпроизошедшего события;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.20. не подлежат страховому возмещению расходы по аптечным счетам/чекам без указания наименования, количества и\r\nстоимости приобретенных медикаментов, перевязочных средств, средств фиксации любого типа, вспомогательных средств\r\nреабилитации (костылей), включая счета по их доставке Застрахованному лицу в период его пребывания на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.2.21. возникновения профессиональной ошибки штатного медицинского персонала медицинского учреждения, имеющего\r\nлицензию на осуществление соответствующего вида медицинской деятельности.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.3. Страховщик освобождается от выплаты страхового возмещения по событиям, наступивших вследствие:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.3.1. воздействия ядерного взрыва, радиации или радиоактивного заражения;<br>\r\n3.3.2. военных действий, а также маневров или иных военных мероприятий;<br>\r\n3.3.3. гражданской войны, народных волнений всякого рода или забастовок.<span>3.4. Страховщик вправе отказать в страховой выплате в следующих случаях:<span>3.4.1. в случае выполнения Страховщиком своих обязательств по договору страхования в полном объеме;<br>\r\n3.4.2. в случае ликвидации Страхователя – юридического лица, также в случае реорганизации Страхователя - юридического лица\r\n</span></span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>в порядке, установленном действующим законодательством, если Застрахованное лицо или иное лицо в соответствии с действующим\r\nзаконодательством не приняли на себя обязанности Страхователя по договору страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>3.5. Не возмещаются Страховщиком любые самостоятельно понесенные расходы Застрахованным лицом (иным лицом,\r\nдействовавшим в его интересах), предварительно не согласованные Сервисной компанией (Страховщиком), за исключением\r\nсамостоятельно понесенных расходов, в порядке и размере, определенных в пункте 6.5 настоящих Условий страхования и договором\r\n(полисом) страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4. Порядок взаимодействия сторон при наступлении страхового случая.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.1. При наступлении события, имеющего признаки страхового случая, Застрахованное лицо (или его представитель) обязано\r\nнезамедлительно обратиться в Сервисную компанию по телефону, указанному в договоре (полисе) страхования, и проинформировать\r\nоператора Сервисной компании о случившемся, сообщив при этом:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- фамилию и имя Застрахованного лица;<br>\r\n- номер и период действия договора (полиса) страхования;<br>\r\n- описание обстоятельств произошедшего и характер требуемой помощи;<br>\r\n- местонахождение Застрахованного лица и номер контактного телефоны для обратной связи.</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>4.1.1. Оператор Сервисной компании вправе запросить дополнительную информацию: паспортные данные, отметки в паспорте\r\nо пересечении границы страны выезда в поездку (согласно проездным документам) и государства территории страхования, адрес\r\nпостоянного места жительства Застрахованного лица и иную другую необходимую информацию для уточнения обстоятельств события\r\nдля целей определения его (события) как страхового. Застрахованное лицо (его представитель) обязано предоставить в кратчайшие\r\nсроки любым доступным средством связи копию паспорта с отметками пограничного контроля о пересечении государственных границ,\r\nкопию договора (полиса) страхования и копии иных документов, имеющих отношение к определению страхового характера события.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.2. Стоимость звонков в Сервисную компанию (Страховщику), связанных с наступлением страхового случая, подлежат\r\nвозмещению Страховщиком при предъявлении подтверждающих документов, с указанием дат, номеров телефонов, продолжительности\r\nи стоимости звонков.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.3. Сервисная компания организует оказание Застрахованному лицу необходимых услуг, предусмотренных договором\r\nстрахования, гарантируя оплату расходов по страховым случаям, предусмотренным договором (полисом) страхования. Исходя из\r\nособенностей организации экстренной и неотложной медицинской и медико-транспортной помощи на территории страны пребывания,\r\nСервисная компания вправе рекомендовать Застрахованному лицу (его представителю) самостоятельно организовать и оплатить\r\nэкстренную и неотложную медицинскую помощь с последующим предоставлением Страховщику оригиналов документов,\r\nподтверждающих понесенные расходы, необходимых для осуществления страховой выплаты в сроки и в порядке, предусмотренные\r\nнастоящими Условиями страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.3.1. В исключительных случаях при отсутствии объективной возможности связаться с Сервисной компанией в момент\r\nнаступления события, имеющего признаки страхового случая, предусмотренного пунктами 1.1.1.1 - 1.1.1.3, 1.1.2.1 настоящих Условий\r\nстрахования, а именно в случаях критического состояния здоровья Застрахованного лица, потребовавшего незамедлительного оказания\r\nмедицинской и медико-транспортной помощи по жизненным показаниям, Застрахованное лицо (или его представитель) обязано\r\nнезамедлительно, как только таковая возможность представится, проинформировать о наступлении страхового события Сервисную\r\nкомпанию и далее неукоснительно следовать указаниям оператора Сервисной компании.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.3.2. По предварительному согласованию с Сервисной компанией (Страховщиком) допускается самостоятельное обращение\r\nЗастрахованного лица за получением медицинской и/или медико-транспортной помощи и её самостоятельная оплата, с последующим\r\nвозмещением Страховщиком понесенных расходов в случае признания произошедшего события страховым случаем.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом, предварительное согласование Сервисной компанией (Страховщиком) самостоятельной оплаты Застрахованным\r\nлицом медицинских и/или медико-транспортных расходов не являются признанием Страховщиком факта наступления страхового случая\r\nв соответствии с условиями договора страхования на момент наступления события, имевшего признаки страхового.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>4.4. Признание наступившего страхового события, предусмотренного договором страхования, страховым случаем и\r\nосуществление Страховщиком страховой выплаты, в порядке, установленном настоящими Условиями страхования, производится только\r\nна основании Заявления на выплату страхового возмещения с приложением необходимых оригиналов документов, подтверждающих\r\nрасходы, понесенные Застрахованным лицом (его законным представителем) по страховому событию.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5. Перечень документов для страховой выплаты по самостоятельно понесенным расходам.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.1. Если Застрахованное лицо самостоятельно оплатило расходы, предварительно согласованные Сервисной компанией\r\n(Страховщиком), связанные со страховым событием, оно должно в течение 35 календарных дней после возвращения из поездки заявить\r\nСтраховщику о случившемся и предоставить оригиналы документов, подтверждающих понесенные расходы в период пребывания на\r\nтерритории страхования. При этом, к документам, составленным на иностранном языке, лицо, обратившееся за страховой выплатой, по\r\nтребованию Страховщика обязано приложить перевод на русский язык, подготовленный специализированной организацией,\r\nосуществляющей деятельность по переводу документов. По соглашению сторон перевод может быть сделан Страховщиком, при этом\r\nСтраховщик имеет право вычесть расходы по переводу на русский язык документов, представленных в связи со страховым случаем, из\r\nсуммы страховой выплаты.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.2. Для решения вопроса о страховой выплате Страховщику должно быть представлено Заявление на страховую выплату с\r\nприложением следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- договор (полис) страхования и Условия страхования (приложение к договору (полису) страхования);<br>\r\n- копия паспорта / документа, удостоверяющего личность Застрахованного лица (Выгодоприобретателя);<br>\r\n- оригиналы всех документов, подтверждающих факт понесенных Застрахованным лицом расходов;<br>\r\n- документы из компетентных органов на территории страхования, подтверждающие факт и обстоятельства произошедшего\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>события, имеющего признаки страхового;<br>\r\n- письменное согласие на получение Страховщиком из медицинского учреждения данных Застрахованного лица, составляющих\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>врачебную тайну, и персональных данных.<br>\r\n5.2.1. Дополнительно в отношении несовершеннолетних и/или недееспособного Застрахованного лица представитель\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Застрахованного лица должен предоставить следующие документы:<br>\r\n- копия свидетельства о рождении Застрахованного лица;<br>\r\n- паспорт Застрахованного лица для лиц старше 14-ти лет;<br>\r\n- копия паспорта Заявителя – одного из родителей (опекуна, попечителя) Застрахованного лица;<br>\r\n- для попечителей и опекунов Застрахованного лица - к пакету документов на страховую выплату прилагается копия документа,\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>удостоверяющего данный статус.<br>\r\n5.2.2. В случае смерти Застрахованного лица Заявитель дополнительно предоставляет:<br>\r\n- документ, удостоверяющий личность, в случае, если он является Выгодоприобретателем, указанным в договоре (полисе)\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>страхования;<br>\r\n- документ, удостоверяющий личность и свидетельство о праве на наследство, если он является наследником по закону.<br>\r\n5.3. По страховому событию, предусмотренному пунктом 1.1.1 настоящих Условий страхования, дополнительно к перечисленным\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>в пункте 5.2 настоящих Условий страхования, Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица)\r\nдолжно в течение 35 календарных дней после возвращения из поездки предоставить оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				<div>\r\n					<div>\r\n						<p>- выписки и счета из медицинских учреждений (на фирменном бланке), содержащие сведения о фамилии, имени пациента,\r\nдиагнозе, дате и состоянии здоровья Застрахованного лица при обращении за помощью, о проведенных медицинских манипуляциях,\r\nпродолжительности лечения, перечне оказанных услуг с разбивкой по датам и стоимости, а также общей сумме к оплате. При этом, все\r\nсправки и выписки из медицинских учреждений, аккредитованных на территории РФ, должны быть заверены подписью руководителя\r\nмедицинского учреждения и официальной печатью медицинского учреждения. Счета из зарубежных клиник оформляются в\r\nсоответствии со стандартами, принятыми в стране пребывания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- рецепты, выписанные врачом в связи с обращением за медицинской помощью, и аптечные счета / чеки с указанием\r\nнаименования, количества и стоимости каждого приобретенного медикамента;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- счета за лабораторно-диагностические исследования с указанием фамилии, имени Застрахованного лица, дат, наименований\r\nи стоимости услуг.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>В случае предоставления документов, которые не могут быть прочтены Страховщиком в связи с особенностями почерка врача,\r\nа также вследствие нарушения целостности документа (надорван, смят, стерт и т.д.), Страховщик вправе отложить решение вопроса о\r\nвыплате страхового возмещения до предоставления документов надлежащего качества.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>В случае выявления факта предоставления Страхователем (Выгодоприобретателем / Застрахованным лицом) документов,\r\nнедостаточных для принятия решения об осуществлении страховой выплаты, и (или) ненадлежащим образом оформленных документов\r\nСтраховщик обязан в течении 15 календарных дней уведомить Страхователя (Выгодоприобретателя/Застрахованное лицо) и указать\r\nперечень недостающих и (или) ненадлежащим образом оформленных документов.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.4. По страховому событию, предусмотренному пунктом 1.1.2 настоящих Условий страхования, дополнительно к перечисленным\r\nв пункте 5.2 настоящих Условий страхования, Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица)</p></div></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>должно в течение 35 календарных дней после возвращения из поездки предоставить оригиналы следующих документов:<br>\r\n- документ, подтверждающий оплату проезда Застрахованного лица в медицинское учреждение транспортным средством,\r\nпредназначенным для скорой медицинской помощи / такси с указанием даты поездки, оплаченной суммы, места отправления и\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>назначения;<br>\r\n- разрешение на вылет, оформленное медицинским учреждением, в котором получает медицинскую стационарную помощь\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Застрахованное лицо;<br>\r\n- авиа / железнодорожный билет класса, рекомендованного в разрешении на вылет/выезд с территории страхования к месту\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>постоянного проживания.<br>\r\n5.5. По страховому событию, предусмотренному пунктом 1.1.3 настоящих Условий страхования, дополнительно к перечисленным\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>в пункте 5.2 настоящих Условий страхования, в случае самостоятельной оплаты расходов, предварительно согласованных Страховщиком\r\n(Сервисной компанией), Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица), должно в течение 35\r\nкалендарных дней после возвращения из поездки предоставить оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				<div>\r\n					<div>\r\n						<p>- счет на посмертную репатриацию, включающий услуги похоронного бюро по подготовке тела к репатриации, стоимость\r\nперевозки тела;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- документ, подтверждающий оплату посмертной репатриации тела в соответствии со счетом;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- для сопровождающего лица – авиа / железнодорожный билет, а также подтверждение о сдаче (невозможности сдачи) билета,\r\nпо которому планировалось возвращение к месту постоянного проживания.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.6. По страховому событию, предусмотренному пунктом 1.1.4 настоящих Условий страхования, дополнительно к перечисленным\r\nв пункте 5.2 настоящих Условий страхования, Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица)\r\nдолжно в течение 35 календарных дней после возвращения из поездки предоставить оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				<div>\r\n					<div>\r\n						<p>- документ, подтверждающий оплату проезда на такси / скорой помощи (или иным транспортным средством) с указанием\r\nфамилии, имени, даты поездки, оплаченной суммы, места отправления и назначения;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>- авиа / железнодорожный билет с территории страхования к месту постоянного проживания;<br>\r\n- авиа / железнодорожный билет (в оба конца) при визите близкого родственника;<br>\r\n- авиа / железнодорожный билет (в оба конца) при визите близкого родственника для сопровождения несовершеннолетнего\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Застрахованного лица;<br>\r\n- документы, подтверждающие самостоятельную оплату расходов, согласно пункту 1.1.4.4 настоящих Условий страхования.<br>\r\n5.7. По страховому событию, предусмотренному пунктом 1.1.5 настоящих Условий страхования, дополнительно к перечисленным\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>в пункте 5.2 настоящих Условий страхования, Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица)\r\nдолжно в течение 35 календарных дней после возвращения из поездки предоставить оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				<div>\r\n					<div>\r\n						<p>- документы, подтверждающие факт проживания Застрахованного лица / близкого родственника Застрахованного лица с\r\nуказанием фамилии, имени, стоимости и сроков проживания в отеле на территории страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>5.8. По страховому событию, предусмотренному пунктом 1.1.6 настоящих Условий страхования, дополнительно к перечисленным\r\nв пункте 5.2 настоящих Условий страхования, Застрахованное лицо (иное лицо, понесшее расходы в пользу Застрахованного лица)\r\nдолжно в течение 35 календарных дней после возвращения из поездки предоставить оригиналы следующих документов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				\r\n				<div>\r\n					<div>\r\n						<p>- в случае оплаты срочных сообщений, связанных с наступлением страхового случая, - документы, подтверждающие такие\r\nрасходы и их стоимость.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6. Страховая выплата. Порядок определения размера и осуществления страховой выплаты по страховому случаю.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.1. Страховая выплата осуществляется в следующем порядке:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.1.1. Страховщик производит оплату счетов Сервисной компании при наступлении события, являющегося страховым случаем в\r\nсоответствии с настоящими Условиями страхования, и определенного в договоре (полисе) страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.1.2. Страховщик возмещает документально подтвержденные и предварительно письменно согласованные\r\nСтраховщиком/Сервисной компанией расходы (до их получения) Застрахованного лица за оказанные ему страховые услуги,\r\nопределенные в договоре (полисе) страхования, понесенные им самостоятельно при наступлении страхового случая. Сумма страхового\r\nвозмещения указывается в страховом акте на выплату страхового возмещения по договору страхования граждан, выезжающих за\r\nпределы постоянного места жительства (далее – страховой акт).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Страховая выплата по страховому полису производится Страховщиком в денежной форме в рублях по курсу ЦБ РФ,\r\nустановленному для валюты, указанной в страховом полисе на дату наступления страхового случая (или по курсу ЦБ РФ, установленному\r\nдля валюты, в которой были заявлены Застрахованным лицом расходы на возмещение – если валюта заявленных к возмещению расходов\r\nне совпадает с валютой, указанной в страховом полисе).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>При этом, при расчете страхового возмещения в рублевом эквиваленте, данное условие применяется в случае, если курс\r\nиностранной валюты, указанной в страховом полисе (или курс иной валюты, в которой заявлены расходы на возмещение), не превышает\r\nмаксимального курса.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Под максимальным курсом понимается курс соответствующей иностранной валюты, установленный ЦБ РФ на дату выплаты\r\nстрахового возмещения, увеличенной на 1 (один) процент за каждый месяц (в т.ч. неполный), прошедший с момента наступления\r\nстрахового случая до даты выплаты страхового возмещения. В случае если курс иностранной валюты, установленный ЦБ РФ на дату\r\nнаступления страхового случая, превысит вышеуказанный максимальный курс, размер страхового возмещения определяется исходя из\r\nмаксимального курса.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Под датой наступления страхового случая понимается дата возникновение расходов при оказании страховой (медицинской или\r\nиной) услуги Застрахованному лицу.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.2. В течение 45 календарных дней с даты получения всех надлежащим образом оформленных оригиналов документов,\r\nнеобходимых и достаточных для осуществления выплаты страхового возмещения по страховому риску, а также письменных документов,\r\nзапрошенных Страховщиком по согласованию с Застрахованным лицом (Выгодоприобретателем), устанавливающих факт наступления\r\nстрахового случая, Страховщик составляет страховой акт, признавая тем самым произошедшее событие страховым случаем, или\r\nпринимает решение об отказе в страховой выплате и письменно сообщает Застрахованному лицу об основаниях принятия решения об\r\nотказе в выплате со ссылками на нормы права и/или условия договора страхования и правил страхования, в течение 3 рабочих дней\r\nпосле принятия решения об отказе в выплате.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.3. В течение 10 рабочих дней после составления страхового акта Страховщик осуществляет страховую выплату.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.4. Страховая выплата осуществляться путем безналичного перечисления на счет Застрахованного лица (Выгодоприобретателя,\r\nзаконного представителя Застрахованного лица) либо выдается Застрахованному лицу (Выгодоприобретателю, законному\r\nпредставителю Застрахованного лица) наличными деньгами в кассе Страховщика.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.5. При самостоятельной оплате Застрахованным лицом (иным лицом, действовавшим в его интересах) медицинских и/или\r\nмедико-транспортных расходов без предварительного согласования их (расходов) Сервисной компанией (Страховщиком), Страховщик\r\nвозмещает эти расходы в лимите 150 долларов США/евро*.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6. При наступлении страхового события, указанного в пункте 1.1 настоящих Условий страхования, Страховщик в соответствии\r\nс предоставленными счетами и документами, подтверждающими наступление страхового случая и размер убытков, определяет размер\r\nстрахового возмещения исходя из предельных сумм обязательств по договору страхования:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1. медицинских расходов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.1. на амбулаторное обслуживание в связи с ухудшением здоровья в результате острых заболеваний, травм и других\r\nнесчастных случаев;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.2. на лечение зубов с обезболиванием при острой боли (в лимите 200 долларов США/евро* за 1 страховой случай, но не\r\nболее 2 страховых случаев в течение срока действия договора страхования) или разрушении (потере) зубов вследствие травм в размере\r\nфактически произведенных расходов;\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<p><br></p></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.3. на стационарное лечение Застрахованного лица, включая расходы на пребывание и лечение в палате стандартного типа;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.4. на неотложное оперативное вмешательство (в случае наличия объективной угрозы жизни Застрахованного лица, не\r\nпозволяющей проведение консервативных методов лечения до возвращения к постоянному месту жительства);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.5. на проведение медицински необходимых и целесообразных диагностических и лабораторных исследований,\r\nдиагностических и лечебных манипуляций и процедур, анестезию;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.6. на медикаменты, назначенные лечащим врачом;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.7. на перевязочные средства; на средства фиксации (исключая расходы на металлоконструкции), а именно: гипс, бандаж,\r\nшина, лонгета, ортез, брейс, корсет; на костыли (в лимите 100 долларов США/евро*);\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.8. по предписанию врача на предоставление медицинского оборудования Застрахованному лицу во временное пользование:\r\nинвалидной коляски, вспомогательных средств;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.1.9. на металлоконструкции в лимите 1000 долларов США/евро*.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.2. медико-транспортных расходов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.2.1. на медицинскую эвакуацию (транспортировку) с места нахождения Застрахованного лица в медицинское учреждение\r\nсоответствующим медицинскому состоянию Застрахованного лица транспортным средством, предназначенным для скорой медицинской\r\nпомощи / такси, а также при наличии медицинской необходимости после получения медицинской помощи и по предварительному\r\nсогласованию Страховщиком - на транспортировку обратно к месту временного проживания на территории страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.2.2. на транспортировку Застрахованного лица из одной клиники в другую согласно пункту 1.1.2.2 настоящих Условий\r\nстрахования в стране (месте) временного проживания;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.2.3. на медицинскую репатриацию Застрахованного лица к месту постоянного проживания Застрахованного лица в\r\nсоответствии с пунктами 1.1.2.3, 1.1.2.4 настоящих Условий страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.3. расходов на посмертную репатриацию:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.3.1. тела умершего Застрахованного лица – в размере расходов на перевозку в соответствии с договором страхования и услуг\r\nпо подготовке к репатриации;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.3.2. на проезд одного совершеннолетнего лица, сопровождающего тело.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4. транспортных расходов:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4.1. на проезд Застрахованного лица до аэропорта / вокзала (на территории страхования) в соответствии с пунктом 1.1.4.1.1\r\nнастоящих Условий страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4.2. на проезд Застрахованного лица к месту постоянного проживания в соответствии с пунктом 1.1.4.1.2 настоящих Условий\r\nстрахования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4.3. на проезд в оба конца одного близкого родственника Застрахованного лица в случае госпитализации Застрахованного\r\nлица в соответствии с пунктом 1.1.4.2 настоящих Условий страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4.4. на проезд одного из родителей несовершеннолетнего Застрахованного лица в соответствии с пунктом 1.1.4.3 настоящих\r\nУсловий страхования;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.4.5. на перевозку багажа, принадлежащего Застрахованному лицу, в соответствии с пунктом 1.1.4.4 настоящих Условий\r\nстрахования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5. расходов на проживание:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.1. указанных в пункте 1.1.5.1 - в размере до 100 долларов США/евро* в день на проживание (без питания) Застрахованного\r\nлица после стационарного лечения в стандартном номере отеля на территории страхования на срок не более 5 календарных дней;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.2. указанных в пункте 1.1.5.2 - в размере до 100 долларов США/евро* в день на проживание (без питания) одного\r\nсовершеннолетнего близкого родственника, сопровождающего несовершеннолетнее Застрахованное лицо, находящееся на\r\nстационарном лечении, в стандартном номере отеля на территории страхования на срок не более 5 календарных дней;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.3. указанных в пункте 1.1.5.3 - в размере до 100 долларов США/евро* в день на проживание совершеннолетнего\r\nЗастрахованного лица (без питания) и несовершеннолетнего Застрахованного лица (с питанием) в стандартном номере отеля на\r\nтерритории страхования на весь срок карантина.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.4. указанных в пункте 1.1.5.4 – в размере до 100 долларов США/евро* в день на проживание (без питания) в стандартном\r\nномере отеля на территории страхования одного совершеннолетнего близкого родственника, сопровождающего несовершеннолетнее\r\nЗастрахованное лицо в поездке в связи с карантином несовершеннолетнего Застрахованного лица на весь срок карантина;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.5. указанных в пункте 1.1.5.5 - в размере до 100 долларов США/евро* в день на проживание (с питанием) в стандартном\r\nномере отеля на территории страхования несовершеннолетнего Застрахованного лица, оставшегося без присмотра сопровождавшего\r\nего в одной поездке совершеннолетнего лица, на срок не более 5 дней. Оплата патронажных услуг осуществляется Страховщиком в\r\nразмере фактических расходов;\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.5.6. указанных в пункте 1.1.5.6 - в размере до 100 долларов США/евро* в день на проживание (без питания) в стандартном\r\nномере отеля на территории страхования одного совершеннолетнего близкого родственника совершеннолетнего Застрахованного лица\r\nна срок не более 5 дней в случае госпитализации Застрахованного лица сроком более 15 дней и при наличии медицинской\r\nнеобходимости в визите родственника.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.6. дополнительных расходов, указанных в пункте 1.1.6 настоящих Условий страхования:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.6.6.1. Застрахованного лица на телефонные переговоры с Сервисной компанией и / или Страховщиком. Возмещение стоимости\r\nрасходов на телефонные переговоры производится на основании оригиналов документов, подтверждающих такие расходы и их\r\nстоимость - в лимите 100 долларов США/евро* по каждому страховому событию.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.7. По случаям лабораторно подтвержденного заболевания Застрахованного лица коронавирусной инфекцией\r\nCOVID-19:\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медицинские расходы Застрахованного лица, связанные с диагностикой и лечением данного заболевания в период его\r\nпребывания в стационаре и/или в обсерваторе для лиц с лабораторно подтвержденным заболеванием коронавирусной инфекцией\r\nCOVID-19 в соответствии с пунктами 1.1.1.1 – 1.1.1.2 настоящих Условий страхования оплачиваются в лимите до 5000 долларов США/евро*\r\n(не более одного случая в период действия договора страхования).\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Медико-транспортные расходы, расходы по посмертной репатриации, транспортные расходы, расходы по проживанию\r\nЗастрахованного лица на территории страхования на период карантина после перенесенного заболевания COVID-19 и иные расходы\r\nЗастрахованного лица в соответствии с пунктами 1.1.2 – 1.1.6 настоящих Условий страхования оплачиваются в размере фактически\r\nпонесенных расходов на территории страхования в лимите страховой суммы (не более одного случая в период действия договора\r\nстрахования), установленной по этим видам помощи/услуг договором страхования, и урегулированными Сервисной компанией.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.7.1. В случае если при заключении договора страхования применен повышающий коэффициент, и покрытие расходов по\r\nповоду коронавирусной инфекции COVID-19 предусмотрено договором страхования (есть запись в графе «Особые условия» в Полисе\r\nЗастрахованного лица), то все расходы Застрахованного лица, возникшие в период его пребывания на территории страхования по\r\nповоду коронавирусной инфекции COVID-19 в соответствии с пунктами 1.1.1 – 1.1.6 настоящих Условий страхования, оплачиваются в\r\nразмере фактически понесенных расходов на территории страхования в период действия договора страхования в лимите страховой\r\nсуммы, установленной по этим видам помощи/услуг договором страхования, и урегулированными Сервисной компанией.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>6.8. Договором страхования может быть установлена безусловная франшиза (часть убытка, которая не подлежит возмещению\r\nСтраховщиком). При безусловной франшизе размер страховой выплаты (суммы, подлежащей к возмещению Страховщиком)\r\nуменьшается на размер франшизы, при этом размер франшизы в денежном выражении установлен договором страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>Безусловная франшиза, при которой размер страховой выплаты определяется как разница между размером убытка и размером\r\nфраншизы, применяется к каждому страховому случаю в период действия договора страхования.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>7. Условия освобождения от ответственности.<br>\r\n7.1. При наступлении обстоятельств непреодолимой силы (форс-мажор) Страховщик вправе приостановить выполнение\r\n</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<p><br></p></div></div></div><div><div><div>\r\n				</div>\r\n			</div>\r\n			<div>\r\n				<div>\r\n					<div>\r\n						<p>обязательств по Договору страхования на время действия таких обстоятельств.<span>7.2. Под обстоятельствами непреодолимой силы стороны понимают любые обстоятельства на территории действия страхования\r\n</span></p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>и/или по маршруту следования на территорию действия страхования по договору страхования/страховому полису, не зависящие от воли\r\nСторон Договора страхования, в том числе: стихийные бедствия (землетрясение, наводнение, ураган), пожар, массовые заболевания\r\n(эпидемии), военные действия и их последствия, террористические акты, диверсии, гражданские волнения, забастовки, мятежи,\r\nвведение чрезвычайного или особого положения, бунты, путчи, государственные перевороты, заговоры, восстания, революции,\r\nвоздействия ядерной энергии, случаи невозможности исполнения Страховщиком обязательств по организации и последующей оплаты\r\nстраховых услуг по причине ограничения перевозок, любых запретительных мер (эпидемиологических, санкционных, финансовых и\r\nиных), установленных органами власти государств, являющихся территорией действия страхования по договору\r\nстрахования/страховому полису и/или по маршруту следования на территорию действия страхования по договору\r\nстрахования/страховому полису, запрет торговых операций, в том числе с отдельными странами вследствие принятия международных\r\nсанкций.\r\n</p>\r\n					</div>\r\n				</div>\r\n				<div>\r\n					<div>\r\n						<p>По всем вопросам, не урегулированным настоящими Условиями страхования и Договором страхования, стороны\r\nДоговора руководствуются Правилами страхования граждан, выезжающих за пределы постоянного места жительства, от\r\n11.06.2020 г.\r\n</p>\r\n						<p>* В зависимости от валюты страховой суммы по договору страхования. Для страховых сумм, установленных по договору\r\nстрахования в рублях, лимиты определены в долларах США.&nbsp;</p>\r\n					</div>\r\n				</div>\r\n			</div>\r\n		</div><br></p><h4 style=\"\"><p></p></h4>','advantages','','',''),(36,NULL,'2022-07-13 19:57:49.695963','2022-07-13 19:59:23.037262',36,1,5,'','8800','','advantages','','',''),(37,NULL,'2022-07-13 20:00:22.157336','2022-07-13 20:00:22.167049',37,1,3,'','8800','Мы предлагаем выгодное страхование с удобными условиями для вас<br>','advantages','','',''),(38,NULL,'2022-07-22 22:30:15.509368','2022-07-22 22:30:15.523569',38,1,3,'','\"8800 help\" поможет за границей!','Наши лицензии и сертификаты качества<br>','mini_slider','','',''),(39,NULL,'2022-07-22 23:03:42.514456','2022-07-22 23:04:42.346668',39,1,3,'','\"8800 help\" незаменимый помощник за границей!','Вы можете связаться с нашими специалистами и получить необходимую информацию<br>','contacts','','','');
