INSERT INTO `products_products` VALUES (9,'9.jpeg','2022-02-14 12:28:23.174183','2022-07-27 14:22:50.468244',1,1,NULL,'','Медицинские и иные расходы/Medical and other expenses  (50000 Евро)','','СК Согласие','20 дней',NULL,22.00,19.50,'','<p><b>Страховая сумма 50000 Евро<br></b></p><b>Страхование граждан, выезжающих за пределы постоянного места жительства</b>– это оказание экстренной медицинской помощи и других услуг в рамках выбранной программы страхования в связи с неожиданным заболеванием или несчастным случаем.<p></p>','<p><b>медицинские расходы</b></p><p>- на амбулаторную / стационарную помощь;</p><p>- на экстренную стоматологическую помощь (в пределах 200€)</p><p></p><p><b>медико-транспортные расходы</b></p><p>- на медицинскую эвакуацию автомашиной скорой помощи с места нахождения Застрахованного лица на территории страхования в ближайшее медицинское учреждение;</p><p>- на транспортировку Застрахованного лица из одной клиники в другую;</p><p>- на медицинскую репатриацию Застрахованного лица с территории страхования</p><p><b>расходы по посмертной репатриации</b></p><p>- тела Застрахованного лица;</p><p>- на проезд одного из близких родственников, сопровождающего тело;</p><p><b>транспортные расходы</b></p><p>- на проезд Застрахованного лица до аэропорта, ж/д вокзала на территории страхования;</p><p>- на проезд Застрахованного лица в один конец к месту постоянного проживания;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику Застрахованного лица, если срок госпитализации Застрахованного лица превысил 15 дней;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику несовершеннолетнего Застрахованного лица в случае оставления несовершеннолетнего Застрахованного лица</p><p>без присмотра совершеннолетним лицом, сопровождавшим его в поездке;</p><p>- на оплату перевозки и услуг по подносу багажа Застрахованного лица на территории страхования;</p><p><b>расходы по проживанию</b></p><p>- связанных с проживанием Застрахованного лица в гостинице на территории страхования после окончания стационарного лечения;</p><p>- связанных с проживанием одного близкого родственника в гостинице на территории страхования при госпитализации несовершеннолетнего Застрахованного лица, продолжающейся после даты запланированного возвращения из поездки;</p><p>- связанных с проживанием в гостинице несовершеннолетнего Застрахованного лица, оставшегося без присмотра сопровождающего его совершеннолетнего лица;</p><p>- связанных с проживанием в гостинице одного близкого родственника совершеннолетнего Застрахованного лица в случае госпитализации Застрахованного лица сроком более 15 дней</p><p>Расходы на проживание оплачиваются на срок не более 5 дней (при карантине - на весь срок карантина).</p><p><b>дополнительные расходы</b></p><p>- на телефонные переговоры с Сервисной компанией / Страховщиком по страховому случаю.</p><p>!!! Обсудить с туроператором- нужно дать информацию по покрытию ковид?</p><p><b>ПокрытиеCOVID-19:</b></p><p>Медицинские расходы в период пребывания Застрахованного лица в стационаре и/или в обсерваторе для лиц с лабораторно подтвержденным заболеванием COVID-19</p><p>покрываются в лимите 5000 €.</p><p>Медико-транспортные расходы, расходы по посмертной репатриации, транспортные расходы, расходы по проживанию на территории страхования на период карантина после перенесенного заболеванияCOVID-19 оплачиваются в размере фактически понесенных расходов в лимите страховой суммы, установленной&nbsp; по этим видам помощи договором страхования.</p><p>Не более одного случая в течение срока страхования.</p>','9',NULL,19.50,19.50,50000,NULL,''),(10,'10.jpg','2022-02-14 12:32:21.930559','2022-07-07 19:03:42.530160',3,1,NULL,'','Страхование отмены поездки (от 1000-2000 Евро)','','СК Согласие','20 дней',NULL,35.00,30.00,'','<p><b>Страховая сумма 1001 Евро до 2000 Евро (покрытие на одного человека на стоимость круиза)<br></b></p><b>Страховым полисом покрываются расходы из-за невозможности совершить поездку или сокращения срока пребывания в поездке</b><p></p>','<p><b>медицинские расходы</b></p><p>- на амбулаторную / стационарную помощь;</p><p>- на экстренную стоматологическую помощь (в пределах 200€)</p><p></p><p><b>медико-транспортные расходы</b></p><p>- на медицинскую эвакуацию автомашиной скорой помощи с места нахождения Застрахованного лица на территории страхования в ближайшее медицинское учреждение;</p><p>- на транспортировку Застрахованного лица из одной клиники в другую;</p><p>- на медицинскую репатриацию Застрахованного лица с территории страхования</p><p><b>расходы по посмертной репатриации</b></p><p>- тела Застрахованного лица;</p><p>- на проезд одного из близких родственников, сопровождающего тело;</p><p><b>транспортные расходы</b></p><p>- на проезд Застрахованного лица до аэропорта, ж/д вокзала на территории страхования;</p><p>- на проезд Застрахованного лица в один конец к месту постоянного проживания;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику Застрахованного лица, если срок госпитализации Застрахованного лица превысил 15 дней;</p><p>- на оплату проезда на территорию страхования одному близкому родственнику несовершеннолетнего Застрахованного лица в случае оставления несовершеннолетнего Застрахованного лица</p><p>без присмотра совершеннолетним лицом, сопровождавшим его в поездке;</p><p>- на оплату перевозки и услуг по подносу багажа Застрахованного лица на территории страхования;</p><p><b>расходы по проживанию</b></p><p>- связанных с проживанием Застрахованного лица в гостинице на территории страхования после окончания стационарного лечения;</p><p>- связанных с проживанием одного близкого родственника в гостинице на территории страхования при госпитализации несовершеннолетнего Застрахованного лица, продолжающейся после даты запланированного возвращения из поездки;</p><p>- связанных с проживанием в гостинице несовершеннолетнего Застрахованного лица, оставшегося без присмотра сопровождающего его совершеннолетнего лица;<